r($,"aY1","aG9",()=>{var q="\uc720\ud615 8",p="\u203b [59~60] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",o=" \uc6b0\ub9ac \uc5b4\uba38\ub2c8\uc640 \uc544\ubc84\uc9c0\ub294 \ubaa8\ub450 \uc77c\uc744 \ud558\uc154\uc11c \uc9d1\uc5d0 \ud63c\uc790 \uc788\ub294 \ub0a0\uc774 \ub9ce\uc558\uc2b5\ub2c8\ub2e4. ( \u3260 ) \ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. ( \u3261 ) \uadf8\ub7f0\ub370 \uc5b4\uba38\ub2c8\uac00 \uac15\uc544\uc9c0\ub97c \uc0ac \uc624\uc2dc\uba74\uc11c \uc81c \uc0dd\ud65c\uc774 \ub2ec\ub77c\uc84c\uc2b5\ub2c8\ub2e4. ( \u3262 ) \uac15\uc544\uc9c0\uc640 \ud568\uaed8 \ub180\uace0 \uac19\uc774 \uc0b0\ucc45\ub3c4 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0b4\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. ( \u3263 ) \uc800\ub294 \uac8c\uc784\ubcf4\ub2e4 \ub354 \uc88b\uc740 \uce5c\uad6c\ub97c \uac16\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. ",n=null,m="\u203b [61~62] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624. ",l="\u203b [63~64] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",k="assets/images/376364.png",j="\u203b [65~66] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",i=" \uc800\ub294 \uc790\uae30 \uc804\uc5d0 \ud558\ub8e8\ub97c \uc815\ub9ac\ud558\uba74\uc11c \uba54\ubaa8\ub97c \ud569\ub2c8\ub2e4. \uba3c\uc800 \uc624\ub298 \uc77c\uc5b4\ub09c \uc77c \uc911\uc5d0\uc11c \uc798 \ud55c \uc77c \uc138 \uac00\uc9c0\ub97c \uc501\ub2c8\ub2e4. \uadf8\ub807\uac8c \ud558\uba74 \ud798\ub4e0 \ud558\ub8e8\ub97c \uc870\uae08 \uc78a\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uadf8 \ub2e4\uc74c\uc5d0\ub294 \ub0b4\uc77c \ud560 \uc77c\uc744 ( \u3260 ). \uadf8\ub7ec\uba74 \uc911\uc694\ud55c \uc77c\uc744 \uc78a\uc5b4\ubc84\ub9ac\uc9c0 \uc54a\uc544\uc11c \uc88b\uc2b5\ub2c8\ub2e4. \uc774\ub807\uac8c \uba54\ubaa8\ub97c \ud558\uba74 \uc0dd\uac01\ub9cc \ud560 \ub54c\ubcf4\ub2e4 \ud558\ub8e8 \ud558\ub8e8\ub97c \ud6e8\uc52c \ub354 \uc798 \uc815\ub9ac\ud560 \uc218 \uc788\uc2b5\ub2c8\ub2e4. ",h="\u203b [67~68] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624. ",g=" \uaf43\uc774\ub098 \ub098\ubb34\uac00 \uc624\ub798 \uc0b4\ub824\uba74 \ubb3c\uacfc \uacf5\uae30, \ud587\ube5b\uc774 \uc911\uc694\ud569\ub2c8\ub2e4. ( \u3260 ) \ub9c9\uc73c\ub824\uba74 \ud654\ubd84\uc744 \ud55c\uacf3\uc5d0 \ubaa8\uc544 \ub193\uc544\uc57c \ud569\ub2c8\ub2e4. \ubb3c\uc5d0 \uc816\uc740 \uc218\uac74\uc744 \ud654\ubd84 \uc544\ub798\uc5d0 \ub193\ub294 \uac83\ub3c4 \uc88b\uc740 \ubc29\ubc95\uc785\ub2c8\ub2e4. \ub610 \uc9d1\uc548\uc5d0\uc11c \uacf5\uae30\uac00 \uc798 \ud1b5\ud560 \uc218 \uc788\uac8c \ubc29\ubb38\uc744 \uc5f4\uc5b4 \ub193\uc73c\uba74 \uc88b\uc2b5\ub2c8\ub2e4. \ub9c8\uc9c0\ub9c9\uc73c\ub85c, \uc5ec\ud589\uc744 \uc624\ub798 \ud560 \ub54c\ub294 \ud587\ube5b\uc774 \uc798 \ub4e4\uc5b4\uc624\uc9c0 \uc54a\ub294 \uacf3\uc5d0 \ud654\ubd84\uc744 \ub193\ub294 \uac83\uc774 \uc88b\uc2b5\ub2c8\ub2e4. ",f="\u203b [69~70] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624. ",e=" \uc800\ub294 \uc9c0\ub09c \uc8fc\ub9d0\uc5d0 \uc544\uc8fc \ud2b9\ubcc4\ud55c \uc0ac\uc9c4\uad00\uc5d0 \uac14\uc2b5\ub2c8\ub2e4. \uadf8 \uc0ac\uc9c4\uad00\uc5d0\ub294 \uc0ac\uc9c4\uc744 \ucc0d\uae30 \uc704\ud55c \ubaa8\ub4e0 \uc900\ube44\uac00 \ub2e4 \ub418\uc5b4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \uc0ac\uc9c4\uc744 \ucc0d\uae30 \uc804\uc5d0 \ud654\uc7a5\ub3c4 \ud574 \uc8fc\uace0 \uba38\ub9ac\ub3c4 \ud574 \uc8fc\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub9ac\uace0 \uc800\uc5d0\uac8c \uc5b4\uc6b8\ub9ac\ub294 \uc637\ub3c4 \ube4c\ub824 \uc8fc\uc5c8\uc2b5\ub2c8\ub2e4. \uac70\uc6b8 \uc18d\uc758 \uc81c \ubaa8\uc2b5\uc774 \ub9c8\uc74c\uc5d0 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. \uc774\ub807\uac8c \uba4b\uc9c4 \ubaa8\uc2b5\uc73c\ub85c \uc0ac\uc9c4\uc744 ( \u3260 ) \uce5c\uad6c\ub4e4\uc5d0\uac8c\ub3c4 \uc18c\uac1c\ud560 \uc0dd\uac01\uc785\ub2c8\ub2e4. "
return A.a([A.l("\u2461 \u3261","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0627\u0644\u0635\u062f\u064a\u0642 \u0627\u0644\u0623\u0641\u0636\u0644 \u0645\u0646 \u0627\u0644\u0623\u0644\u0639\u0627\u0628. \u064a\u0645\u0636\u064a \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0648\u0642\u062a\u0647 \u0628\u0645\u0641\u0631\u062f\u0647 \u0639\u0627\u062f\u0629 \u0641\u064a \u0627\u0644\u0644\u0639\u0628.\u0623\u062d\u0628 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0623\u0644\u0639\u0627\u0628. \u0644\u0630\u0644\u0643 \u064a\u0635\u0628\u062d \u0627\u0644\u062a\u0631\u062a\u064a\u0628 \u0627\u0644\u062a\u0627\u0644\u064a : [\ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \ud55c \ubc88 \ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc549\uc73c\uba74 \ubc25\ub3c4 \uc548 \uba39\uace0 \uac8c\uc784\uc744 \ud560 \ub54c\ub3c4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.]","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u6bd4\u6e38\u620f\u66f4\u597d\u7684\u670b\u53cb\u3002 \u5f53\u4ed6\u4e00\u4e2a\u4eba\u7684\u65f6\u5019\uff0c\u4ed6\u901a\u5e38\u628a\u65f6\u95f4\u82b1\u5728\u73a9\u6e38\u620f\u4e0a\u3002 \u4ed6\u559c\u6b22\u6253\u6e38\u620f\u3002 \u6240\u4ee5\u987a\u5e8f\u4e3a[\u4e00\u4e2a\u4eba\u7684\u65f6\u5019\uff0c\u901a\u5e38\u628a\u65f6\u95f4\u82b1\u5728\u73a9\u6e38\u620f\u4e0a\u3002 \u2192 \u3261 \u6709\u51e0\u6b21\u5750\u5728\u7535\u8111\u524d\u73a9\u6e38\u620f\u751a\u81f3\u4e0d\u5403\u996d\u3002] \u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u6bd4\u904a\u6232\u66f4\u597d\u7684\u670b\u53cb\u3002\u7576\u4ed6\u4e00\u500b\u4eba\u7684\u6642\u5019\uff0c\u4ed6\u901a\u5e38\u628a\u6642\u9593\u82b1\u5728\u73a9\u904a\u6232\u4e0a\u3002\u4ed6\u559c\u6b61\u6253\u904a\u6232\u3002\u6240\u4ee5\u9806\u5e8f\u70ba[\u4e00\u500b\u4eba\u7684\u6642\u5019\uff0c\u901a\u5e38\u628a\u6642\u9593\u82b1\u5728\u73a9\u904a\u6232\u4e0a\u3002 \u2192 \u3261 \u6709\u5e7e\u6b21\u5750\u5728\u96fb\u8166\u524d\u73a9\u904a\u6232\u751a\u81f3\u4e0d\u5403\u98ef\u3002 ] \u3002","This text says this person prefers playing games to having time with his friends. He usually spent time playing games when home alone. So, this is the correct order. [\ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \ud55c \ubc88 \ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc549\uc73c\uba74 \ubc25\ub3c4 \uc548 \uba39\uace0 \uac8c\uc784\uc744 \ud560 \ub54c\ub3c4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.] "," \u2460 \u3260\n \u2461 \u3261\n \u2462 \u3262\n \u2463 \u3263"," \ud55c \ubc88 \ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc549\uc73c\uba74 \ubc25\ub3c4 \uc548 \uba39\uace0 \uac8c\uc784\uc744 \ud560 \ub54c\ub3c4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.",1,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u30b2\u30fc\u30e0\u3088\u308a\u826f\u3044\u53cb\u4eba\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u4eba\u306f\u4e00\u4eba\u3067\u3044\u308b\u6642\u306f\u666e\u901a\u30b2\u30fc\u30e0\u3092\u3057\u306a\u304c\u3089\u6642\u9593\u3092\u904e\u3054\u3057\u307e\u3057\u305f\u3002\u3053\u306e\u4eba\u306f\u30b2\u30fc\u30e0\u304c\u597d\u304d\u3067\u3057\u305f\u3002\u3057\u305f\u304c\u3063\u3066[\ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4.(\u4e00\u4eba\u3067\u3044\u308b\u6642\u306f\u666e\u901a\u30b2\u30fc\u30e0\u3092\u3057\u306a\u304c\u3089\u6642\u9593\u3092\u904e\u3054\u3057\u307e\u3057\u305f) \u2192 \u3261 \ud55c \ubc88 \ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc549\uc73c\uba74 \ubc25\ub3c4 \uc548 \uba39\uace0 \uac8c\uc784\uc744 \ud560 \ub54c\ub3c4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.(\u4e00\u5ea6\u30d1\u30bd\u30b3\u30f3\u306e\u524d\u306b\u5ea7\u308b\u3068\u3054\u98ef\u3082\u98df\u3079\u305a\u306b\u30b2\u30fc\u30e0\u3092\u3059\u308b\u6642\u3082\u3042\u308a\u307e\u3057\u305f)]\u306e\u9806\u3067\u3059\u3002","\uc774 \uae00\uc740 \uac8c\uc784\ubcf4\ub2e4 \ub354 \uc88b\uc740 \uce5c\uad6c\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \uac8c\uc784\uc744 \uc88b\uc544\ud588\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c [\ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \ud55c \ubc88 \ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc549\uc73c\uba74 \ubc25\ub3c4 \uc548 \uba39\uace0 \uac8c\uc784\uc744 \ud560 \ub54c\ub3c4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.] \uc21c\uc11c\uc785\ub2c8\ub2e4.","Petikan tersebut berbincang tentang orang yang lebih suka bermain permainanan komputer daripada berjumpa dengan kawan. Dia mengisi masa lapang dengan bermain permainan komputer bersendirian di rumah.Susunan yang betul ialah  [\ud63c\uc790 \uc788\uc73c\uba74 \ubcf4\ud1b5 \uac8c\uc784\uc744 \ud558\uba74\uc11c \uc2dc\uac04\uc744 \ubcf4\ub0c8\uc2b5\ub2c8\ub2e4. \u2192 \u3261 \ud55c \ubc88 \ucef4\ud4e8\ud130 \uc55e\uc5d0 \uc549\uc73c\uba74 \ubc25\ub3c4 \uc548 \uba39\uace0 \uac8c\uc784\uc744 \ud560 \ub54c\ub3c4 \uc788\uc5c8\uc2b5\ub2c8\ub2e4.].",q,n,"59. \ub2e4\uc74c \ubb38\uc7a5\uc774 \ub4e4\uc5b4\uac08 \uacf3\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",p,o),A.l("\u2463 \uc800\ub294 \uac15\uc544\uc9c0\uc640 \ubcf4\ub0b4\ub294 \uc2dc\uac04\uc774 \uc990\uac81\uc2b5\ub2c8\ub2e4.","1- \u064a\u062d\u0628 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0623\u0644\u0639\u0627\u0628 2- \u064a\u062a\u0645\u0634\u0649 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0645\u0639 \u0627\u0644\u0643\u0644\u0628 \u0647\u0630\u0647 \u0627\u0644\u0623\u064a\u0627\u0645 3- \u064a\u0628\u0642\u0649 \u0647\u0630\u0627 \u0627\u0644\u0631\u062c\u0644 \u0641\u064a \u0627\u0644\u0628\u064a\u062a \u0628\u0645\u0641\u0631\u062f\u0647 \u0643\u062b\u064a\u0631\u0627","\u2460 \u6b64\u4eba\u559c\u6b22\u73a9\u6e38\u620f\u3002 \u2461 \u6b64\u4eba\u8fd9\u51e0\u5929\u5e26\u7740\u4ed6\u7684\u72d7\u53bb\u6563\u6b65\u3002 \u2462 \u6b64\u4eba\u4e00\u4e2a\u4eba\u5728\u5bb6\u7684\u65f6\u5019\u5f88\u591a\u3002","\u2460 \u6b64\u4eba\u559c\u6b61\u73a9\u904a\u6232\u3002 \u2461 \u6b64\u4eba\u9019\u5e7e\u5929\u5e36\u8457\u4ed6\u7684\u72d7\u53bb\u6563\u6b65\u3002 \u2462 \u6b64\u4eba\u4e00\u500b\u4eba\u5728\u5bb6\u7684\u6642\u5019\u5f88\u591a\u3002","\u2461 This person likes to play games. \u2462 This person goes for a walk with his dog these days. \u2463 This person had many days at home alone."," \u2460 \uc6b0\ub9ac \uc5b4\uba38\ub2c8\ub294 \uac8c\uc784\uc744 \uc88b\uc544\ud558\uc2ed\ub2c8\ub2e4.\n \u2461 \uc800\ub294 \uc694\uc998 \uc5b4\uba38\ub2c8\uc640 \ud568\uaed8 \uc0b0\ucc45\uc744 \ud569\ub2c8\ub2e4.\n \u2462 \uc6b0\ub9ac \uc5b4\uba38\ub2c8\ub294 \uc9d1\uc5d0 \uacc4\uc2e4 \ub54c\uac00 \ub9ce\uc2b5\ub2c8\ub2e4.\n \u2463 \uc800\ub294 \uac15\uc544\uc9c0\uc640 \ubcf4\ub0b4\ub294 \uc2dc\uac04\uc774 \uc990\uac81\uc2b5\ub2c8\ub2e4.",n,2,"\u2460\u3053\u306e\u4eba\u306f\u30b2\u30fc\u30e0\u304c\u597d\u304d\u3067\u3059\u3002\u2461\u3053\u306e\u4eba\u306f\u6700\u8fd1\u72ac\u3068\u4e00\u7dd2\u306b\u6563\u6b69\u3092\u3057\u307e\u3059\u3002\u2462\u3053\u306e\u4eba\u306f\u5bb6\u306b\u4e00\u4eba\u3067\u3044\u308b\u65e5\u304c\u591a\u304b\u3063\u305f\u3067\u3059\u3002","\u2460 \uc774 \uc0ac\ub78c\uc740 \uac8c\uc784\uc744 \uc88b\uc544\ud569\ub2c8\ub2e4. \u2461 \uc774 \uc0ac\ub78c\uc740 \uc694\uc998 \uac15\uc544\uc9c0\uc640 \ud568\uaed8 \uc0b0\ucc45\uc744 \ud569\ub2c8\ub2e4. \u2462 \uc774 \uc0ac\ub78c\uc740 \uc9d1\uc5d0 \ud63c\uc790 \uc788\ub294 \ub0a0\uc774 \ub9ce\uc558\uc2b5\ub2c8\ub2e4. ","\u2460 Orang tersebut suka bermain permainan komputer.\u2461 Orang tersebut berjalan-jalan dengan anjingnya baru-baru ini. \u2462 Orang tersebut mempunyai banyak masa untuk berada di rumah bersendirian.",q,n,"60. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",p,o),A.l("\u2462 \uc785\uc744 \ub54c\ub9c8\ub2e4","\u064a\u062a\u062d\u062f\u062b \u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u0639\u0646 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0630\u064a \u0635\u0646\u0639 \u062a\u064a\u0634\u064a\u0631\u062a \u0628\u0646\u0641\u0633\u0647 \u0648\u0627\u0631\u062a\u062f\u0627\u0647\u0627. \u0627\u0631\u062a\u062f\u0649 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0645\u0639 \u0635\u062f\u064a\u0642\u0647 \u0627\u0644\u062a\u064a\u0634\u064a\u0631\u062a \u0627\u0644\u062a\u064a \u0635\u0646\u0639\u0647\u0627.\u0627\u0639\u062a\u0628\u0631 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0635\u062f\u064a\u0642\u0647 \u0627\u0644\u0630\u064a \u0627\u0631\u062a\u062f\u0649 \u0645\u0639\u0647 \u0646\u0641\u0633 \u0627\u0644\u062a\u064a\u0634\u064a\u0631\u062a \u0645\u0647\u0645\u0627. \u0644\u0630\u0644\u0643 \u064a\u062a\u0630\u0643\u0631 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0635\u062f\u064a\u0642\u0647 \u0643\u0644\u0645\u0627 \u0627\u0631\u062a\u062f\u0649 \u062a\u0644\u0643 \u0627\u0644\u0645\u0644\u0627\u0628\u0633","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u8fd9\u4e2a\u4eba\u5236\u4f5c\u548c\u7a7f\u7740T\u6064\u7684\u7ecf\u5386\u3002 \u4ed6\u548c\u670b\u53cb\u4e00\u8d77\u505a\u4e86\u4e00\u4ef6T\u6064\u5e76\u7a7f\u4e0a\u4e86\u3002 \u4ed6\u89c9\u5f97\u4e00\u8d77\u7a7f\u7740\u540c\u6837T\u6064\u7684\u670b\u53cb\u5f88\u73cd\u8d35\u3002 \u6240\u4ee5\u6bcf\u6b21\u5f53\u4ed6\u7a7f\u90a3\u4ef6\u8863\u670d\u7684\u65f6\u5019\uff0c\u4ed6\u90fd\u4f1a\u60f3\u8d77\u90a3\u4e2a\u670b\u53cb\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u9019\u500b\u4eba\u88fd\u4f5c\u548c\u7a7f\u8457T\u6064\u7684\u7d93\u6b77\u3002\u4ed6\u548c\u670b\u53cb\u4e00\u8d77\u505a\u4e86\u4e00\u4ef6T\u5379\u4e26\u7a7f\u4e0a\u4e86\u3002\u4ed6\u89ba\u5f97\u4e00\u8d77\u7a7f\u8457\u540c\u6a23T\u6064\u7684\u670b\u53cb\u5f88\u73cd\u8cb4\u3002\u6240\u4ee5\u6bcf\u6b21\u7576\u4ed6\u7a7f\u90a3\u4ef6\u8863\u670d\u7684\u6642\u5019\uff0c\u4ed6\u90fd\u6703\u60f3\u8d77\u90a3\u500b\u670b\u53cb\u3002","This text is about the experience of making his own T-shirts. He made T-shirts with his friend. He felt precious about a friend wearing the same T-shirt."," \u2460 \ub9cc\ub4e0 \uc9c0\n \u2461 \ub9cc\ub4e0 \ud6c4\uc5d0\n \u2462 \uc785\uc744 \ub54c\ub9c8\ub2e4\n \u2463 \uc785\uc5b4 \ubd10\uc11c",n,3,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u3053\u306e\u4eba\u304cT\u30b7\u30e3\u30c4\u3092\u4f5c\u3063\u3066\u7740\u305f\u7d4c\u9a13\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u4eba\u306f\u53cb\u4eba\u3068\u4e00\u7dd2\u306bT\u30b7\u30e3\u30c4\u3092\u4f5c\u3063\u3066\u7740\u307e\u3057\u305f\u3002\u3053\u306e\u4eba\u306f\u540c\u3058T\u30b7\u30e3\u30c4\u3092\u7740\u305f\u53cb\u4eba\u304c\u5927\u5207\u306b\u601d\u3048\u307e\u3057\u305f\u3002\u3060\u304b\u3089\u3053\u306e\u4eba\u306f\u305d\u306e\u670d\u3092\u7740\u308b\u305f\u3073\u306b\u305d\u306e\u53cb\u4eba\u306e\u3053\u3068\u3092\u601d\u3044\u51fa\u3059\u3067\u3057\u3087\u3046\u3002","\uc774 \uae00\uc740 \uc774 \uc0ac\ub78c\uc774 \ud2f0\uc154\uce20\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc785\uc740 \uacbd\ud5d8\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \uce5c\uad6c\uc640 \ud568\uaed8 \ud2f0\uc154\uce20\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc785\uc5c8\uc2b5\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \uac19\uc740 \ud2f0\uc154\uce20\ub97c \uc785\uc740 \uce5c\uad6c\uac00 \uc18c\uc911\ud558\uac8c \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc774 \uc0ac\ub78c\uc740 \uadf8 \uc637\uc744 \uc785\uc744 \ub54c\ub9c8\ub2e4 \uadf8 \uce5c\uad6c\uac00 \uc0dd\uac01\ub0a0 \uac81\ub2c8\ub2e4.","Petikan tersebut berbincang tentang pengalaman seseorang yang membuat t-shirt sendiri. Dia membuat T-shirt baru dengan kawannya. Dia berasa sangat unik kerana dapat memakai T-shirt yang sama dengan kawannya.Jadi, dia selalu berfikir tentang kawannya jika dia memakai T-shirt itu.",q,n,"61. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",m," \uc800\ub294 \uc5b4\uc81c \uce5c\uad6c\ud558\uace0 \uc7ac\ubbf8\uc788\ub294 \uc637 \uac00\uac8c\uc5d0 \uac14\uc2b5\ub2c8\ub2e4. \uadf8 \uac00\uac8c\uc5d0\uc11c\ub294 \uc6b0\ub9ac\uac00 \ud2f0\uc154\uce20\uc758 \uadf8\ub9bc\uc744 \uc9c1\uc811 \uadf8\ub9b4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub9bc\uc744 \uadf8\ub824\uc11c \uc8fc\uba74 \uadf8\uac83\uc744 \ud2f0\uc154\uce20\ub85c \ub9cc\ub4e4\uc5b4 \uc90d\ub2c8\ub2e4. \uc5b4\uc81c \uc6b0\ub9ac\ub294 \ud2f0\uc154\uce20\ub97c \ud558\ub098\uc529 \ub9cc\ub4e4\uc5b4 \uc785\uc5c8\uc2b5\ub2c8\ub2e4. \uac19\uc740 \ud2f0\uc154\uce20\ub97c \uc785\uc73c\ub2c8\uae4c\uce5c\uad6c\uac00 \ub354 \uc18c\uc911\ud558\uac8c \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4. \uadf8 \uc637\uc744 ( \u3260 ) \uce5c\uad6c\uac00 \uc0dd\uac01\ub0a0 \uac83 \uac19\uc2b5\ub2c8\ub2e4. "),A.l("\u2463 \uc6b0\ub9ac\ub294 \uac19\uc740 \ud2f0\uc154\uce20\ub97c \uc785\uace0 \ub354 \uac00\uae5d\uac8c \ub290\uaf08\uc2b5\ub2c8\ub2e4.","1- \u0631\u0633\u0645 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0639\u0644\u0649 \u0627\u0644\u062a\u064a\u0634\u064a\u0631\u062a \u0645\u0639 \u0635\u062f\u064a\u0642\u0647 \u0623\u0645\u0633 2- \u0635\u0646\u0639 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u062a\u064a\u0634\u064a\u0631\u062a \u0645\u0639 \u0635\u062f\u064a\u0642\u0647 \u0641\u064a \u0627\u0644\u0645\u062d\u0644 \u0648\u0627\u0631\u062a\u062f\u0627\u0647\u0627 3- \u0631\u0633\u0645\u0646\u0627 \u0627\u0644\u0631\u0633\u0645\u0629 \u0648\u0623\u0639\u0637\u064a\u0646\u0627\u0647\u0627 \u0644\u0644\u0645\u062d\u0644","\u2460 \u6b64\u4eba\u6628\u5929\u548c\u670b\u53cb\u753b\u4e86\u4e00\u5f20T\u6064\u7684\u56fe\u3002 \u2461 \u6b64\u4eba\u4e0e\u670b\u53cb\u5728\u5e97\u5185\u5236\u4f5c\u5e76\u7a7f\u7740T\u6064\u3002 \u2462 \u6211\u4eec\u753b\u4e86\u4e00\u5e45\u753b\u4ea4\u7ed9\u4e86\u5546\u5e97\u3002","\u2460 \u6b64\u4eba\u6628\u5929\u548c\u670b\u53cb\u756b\u4e86\u4e00\u5f35T\u6064\u7684\u5716\u3002 \u2461 \u6b64\u4eba\u8207\u670b\u53cb\u5728\u5e97\u5167\u88fd\u4f5c\u4e26\u7a7f\u8457T\u5379\u3002 \u2462 \u6211\u5011\u756b\u4e86\u4e00\u5e45\u756b\u4ea4\u7d66\u4e86\u5546\u5e97\u3002","\u2460 This person painted a picture on T-shirts yesterday. \u2461 This person made T-shirts with his friend at the store. \u2462 We painted a picture and gave it to the store."," \u2460 \uc800\ub294 \uc5b4\uc81c \uce5c\uad6c\uc640 \ud2f0\uc154\uce20\ub97c \uad6c\uacbd\ud588\uc2b5\ub2c8\ub2e4.\n \u2461 \uc800\ub294 \uce5c\uad6c\uc758 \ud2f0\uc154\uce20\ub97c \uc0ac\ub7ec \uac00\uac8c\uc5d0 \uac14\uc2b5\ub2c8\ub2e4.\n \u2462 \uac00\uac8c\uc5d0\uc11c \uc6b0\ub9ac\uac00 \uc6d0\ud558\ub294 \uadf8\ub9bc\uc744 \uadf8\ub824 \uc8fc\uc5c8\uc2b5\ub2c8\ub2e4.\n \u2463 \uc6b0\ub9ac\ub294 \uac19\uc740 \ud2f0\uc154\uce20\ub97c \uc785\uace0 \ub354 \uac00\uae5d\uac8c \ub290\uaf08\uc2b5\ub2c8\ub2e4.",n,4,"\u2460\u3053\u306e\u4eba\u306f\u6628\u65e5\u53cb\u4eba\u3068T\u30b7\u30e3\u30c4\u306e\u7d75\u3092\u63cf\u304d\u307e\u3057\u305f\u3002\u2461\u3053\u306e\u4eba\u306f\u53cb\u4eba\u3068\u5e97\u3067T\u30b7\u30e3\u30c4\u3092\u4f5c\u3063\u3066\u7740\u307e\u3057\u305f\u3002\u2462\u3053\u306e\u4eba\u3068\u53cb\u4eba\u304c\u7d75\u3092\u63cf\u3044\u3066\u5e97\u306b\u6e21\u3057\u307e\u3057\u305f\u3002","\u2460 \uc774 \uc0ac\ub78c\uc740 \uc5b4\uc81c \uce5c\uad6c\uc640 \ud2f0\uc154\uce20\uc758 \uadf8\ub9bc\uc744 \uadf8\ub838\uc2b5\ub2c8\ub2e4. \u2461 \uc774 \uc0ac\ub78c\uc740 \uce5c\uad6c\uc640 \uac00\uac8c\uc5d0\uc11c \ud2f0\uc154\uce20\ub97c \ub9cc\ub4e4\uc5b4\uc11c \uc785\uc5c8\uc2b5\ub2c8\ub2e4. \u2462 \uc6b0\ub9ac\uac00 \uadf8\ub9bc\uc744 \uadf8\ub824\uc11c \uac00\uac8c\uc5d0 \uc8fc\uc5c8\uc2b5\ub2c8\ub2e4.","\u2460 Orang tersebut telah melukis lukisan T-shirt dengan kawannya. \u2461 Orang tersebut membuat T-shirt baru dengan kawannya di kedai baju. \u2462 Kami melukis lukisan dan memberi lukisan itu kepada kedai baju.",q,n,"62. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",m," \uc800\ub294 \uc5b4\uc81c \uce5c\uad6c\ud558\uace0 \uc7ac\ubbf8\uc788\ub294 \uc637 \uac00\uac8c\uc5d0 \uac14\uc2b5\ub2c8\ub2e4. \uadf8 \uac00\uac8c\uc5d0\uc11c\ub294 \uc6b0\ub9ac\uac00 \ud2f0\uc154\uce20\uc758 \uadf8\ub9bc\uc744 \uc9c1\uc811 \uadf8\ub9b4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uadf8\ub9bc\uc744 \uadf8\ub824\uc11c \uc8fc\uba74 \uadf8\uac83\uc744 \ud2f0\uc154\uce20\ub85c \ub9cc\ub4e4\uc5b4 \uc90d\ub2c8\ub2e4. \uc5b4\uc81c \uc6b0\ub9ac\ub294 \ud2f0\uc154\uce20\ub97c \ud558\ub098\uc529 \ub9cc\ub4e4\uc5b4 \uc785\uc5c8\uc2b5\ub2c8\ub2e4. \uac19\uc740 \ud2f0\uc154\uce20\ub97c \uc785\uc73c\ub2c8\uae4c\uce5c\uad6c\uac00 \ub354 \uc18c\uc911\ud558\uac8c \ub290\uaef4\uc84c\uc2b5\ub2c8\ub2e4. \uadf8 \uc637\uc744 ( \u3260 ) \uce5c\uad6c\uac00 \uc0dd\uac01\ub0a0 \uac83 \uac19\uc2b5\ub2c8\ub2e4."),A.l("\u2461 \uc74c\uc545\ud68c\uc5d0 \ucd08\ub300\ud558\ub824\uace0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u0647\u0648 \u062f\u0639\u0648\u0629 \u0628\u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0644\u062d\u0641\u0644\u0629 \u0645\u0648\u0633\u064a\u0642\u064a\u0629. \u064a\u0639\u0632\u0641 \u0641\u064a\u0647\u0627 \u0637\u0644\u0627\u0628 \u0643\u0648\u0631\u064a\u0648\u0646 \u064a\u062f\u0631\u0633\u0648\u0646 \u0627\u0644\u0645\u0648\u0633\u064a\u0642\u0649 \u0627\u0644\u062a\u0642\u0644\u064a\u062f\u064a\u0629.\u064a\u0642\u062f\u0645 \u0627\u0644\u0628\u0631\u064a\u062f \u0627\u0644\u0625\u0644\u0643\u062a\u0631\u0648\u0646\u064a \u0625\u0631\u0634\u0627\u062f\u0627\u062a \u062d\u0648\u0644 \u0648\u0642\u062a \u0627\u0644\u0639\u0631\u0636 \u0648\u0648\u0642\u062a \u0627\u0644\u062d\u0636\u0648\u0631 \u0648\u0627\u0644\u0645\u0643\u0627\u0646 \u0648\u0627\u0644\u0623\u0646\u0634\u0637\u0629 \u0628\u0639\u062f \u0627\u0644\u062d\u0641\u0644","\u8fd9\u7bc7\u6587\u7ae0\u662f\u97f3\u4e50\u4f1a\u7684\u9080\u8bf7\u90ae\u4ef6\u3002 \u5b66\u4e60\u4f20\u7edf\u97f3\u4e50\u7684\u97e9\u56fd\u5b66\u751f\u8868\u6f14\u3002 \u63d0\u4f9b\u4e86\u6f14\u51fa\u65f6\u95f4\u3001\u5230\u8fbe\u65f6\u95f4\u3001\u6f14\u51fa\u5730\u70b9\u3001\u6f14\u51fa\u7ed3\u675f\u540e\u7684\u65e5\u7a0b\u7b49\u4fe1\u606f\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u97f3\u6a02\u6703\u7684\u9080\u8acb\u90f5\u4ef6\u3002\u5b78\u7fd2\u50b3\u7d71\u97f3\u6a02\u7684\u97d3\u570b\u5b78\u751f\u8868\u6f14\u3002\u63d0\u4f9b\u4e86\u6f14\u51fa\u6642\u9593\u3001\u5230\u9054\u6642\u9593\u3001\u6f14\u51fa\u5730\u9ede\u3001\u6f14\u51fa\u7d50\u675f\u5f8c\u7684\u65e5\u7a0b\u7b49\u4fe1\u606f\u3002","This text is an email inviation to the music concert. The performers are the Korean students who major in Korean traditional music. The text describes the time and place of the performance, the time to come, and the schedule after the performance."," \u2460 \uc74c\uc545\ud68c\ub97c \uacc4\ud68d\ud558\ub824\uace0\n \u2461 \uc74c\uc545\ud68c\uc5d0 \ucd08\ub300\ud558\ub824\uace0\n \u2462 \uc74c\uc545\ud68c \ucc38\uc11d\uc744 \ud655\uc778\ud558\ub824\uace0\n \u2463 \uc74c\uc545\ud68c \ucc38\uc11d\uc5d0 \uac10\uc0ac\ud558\ub824\uace0",n,5,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u97f3\u697d\u4f1a\u306e\u62db\u5f85\u30e1\u30fc\u30eb\u3067\u3059\u3002\u4f1d\u7d71\u97f3\u697d\u3092\u5b66\u3093\u3067\u3044\u308b\u97d3\u56fd\u4eba\u5b66\u751f\u305f\u3061\u304c\u6f14\u594f\u3057\u307e\u3059\u3002\u516c\u6f14\u6642\u9593\u3068\u96c6\u5408\u6642\u9593\u3001\u516c\u6f14\u5834\u6240\u3001\u516c\u6f14\u5f8c\u306e\u65e5\u7a0b\u306a\u3069\u3092\u6848\u5185\u3057\u3066\u3044\u307e\u3059\u3002","\uc774 \uae00\uc740 \uc74c\uc545\ud68c \ucd08\ub300 \uc774\uba54\uc77c\uc785\ub2c8\ub2e4. \uc804\ud1b5 \uc74c\uc545\uc744 \uacf5\ubd80\ud558\ub294 \ud55c\uad6d \ud559\uc0dd\ub4e4\uc774 \uc5f0\uc8fc\ub97c \ud569\ub2c8\ub2e4. \uacf5\uc5f0 \uc2dc\uac04\uacfc \uc640\uc57c\ud558\ub294 \uc2dc\uac04, \uacf5\uc5f0 \uc7a5\uc18c, \uacf5\uc5f0 \ud6c4 \uc77c\uc815 \ub4f1\uc744 \uc548\ub0b4\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4. ","Petikan tersebut adalah e-mel jemputan ke konsert muzik.Pelakon-pelakon di konsert itu ialah pelajar Korea yang belajar muzik tradisional Korea di kolej.Dalam e-mel tersebut, masa, tempat dan jadual waktu konsert telah diketahui.",q,k,"63. \ud55c\uad6d\uc5b4\ud559\uacfc\uc5d0\uc11c\ub294 \uc65c \uc774 \uae00\uc744 \uc37c\uc2b5\ub2c8\uae4c? (2\uc810)",l,n),A.l("\u2463 \uc74c\uc545\ud68c\ub97c \ud55c \ud6c4\uc5d0 \ub2e4 \ud568\uaed8 \uc800\ub141\uc744 \uba39\uc744 \uac81\ub2c8\ub2e4.","1- \u0633\u062a\u0628\u062f\u0623 \u0627\u0644\u062d\u0641\u0644\u0629 \u0627\u0644\u0645\u0648\u0633\u064a\u0642\u064a\u0629 \u0641\u064a \u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u0631\u0627\u0628\u0639\u0629 \u0645\u0633\u0627\u0621 2- \u0633\u064a\u0639\u0632\u0641 \u0641\u064a\u0647\u0627 \u0637\u0644\u0627\u0628 \u0643\u0648\u0631\u064a\u0648\u0646 \u064a\u062f\u0631\u0633\u0648\u0646 \u0627\u0644\u0645\u0648\u0633\u064a\u0642\u0649 \u0627\u0644\u062a\u0642\u0644\u064a\u062f\u064a\u0629 3- \u0647\u0630\u0627 \u0627\u0644\u062d\u0641\u0644 \u0647\u0648 \u0639\u0631\u0636 \u0645\u0648\u0633\u064a\u0642\u064a \u0644\u0644\u0637\u0644\u0627\u0628 \u0627\u0644\u0623\u062c\u0627\u0646\u0628","\u2460 \u97f3\u4e50\u4f1a\u5c06\u5728\u4e0b\u5348 4 \u70b9\u5f00\u59cb\u3002 \u2461\u5b66\u4e60\u4f20\u7edf\u97f3\u4e50\u7684\u97e9\u56fd\u5b66\u751f\u5c06\u8868\u6f14\u3002 \u2462 \u672c\u6b21\u6f14\u51fa\u4e3a\u7559\u5b66\u751f\u51c6\u5907\u7684\u97f3\u4e50\u4f1a\u3002","\u2460 \u97f3\u6a02\u6703\u5c07\u5728\u4e0b\u5348 4 \u9ede\u958b\u59cb\u3002 \u2461\u5b78\u7fd2\u50b3\u7d71\u97f3\u6a02\u7684\u97d3\u570b\u5b78\u751f\u5c07\u8868\u6f14\u3002 \u2462 \u672c\u6b21\u6f14\u51fa\u70ba\u7559\u5b78\u751f\u6e96\u5099\u7684\u97f3\u6a02\u6703\u3002","\u2460 The music concert starts at 4 p.m. \u2461 The performers are the Korean students who major in Korean traditional music. \u2462 This concert is for the foreign students."," \u2460 \uc74c\uc545\ud68c\ub294 \uc138 \uc2dc \uc0bc\uc2ed \ubd84\uc5d0 \uc2dc\uc791\ud560 \uac81\ub2c8\ub2e4.\n \u2461 \uc720\ud559\uc0dd\ub4e4\uc774 \ud55c\uad6d \uc804\ud1b5 \uc74c\uc545\uc744 \uc5f0\uc8fc\ud560 \uac81\ub2c8\ub2e4.\n \u2462 \uc74c\uc545\uc744 \uacf5\ubd80\ud558\ub294 \ud559\uc0dd\ub4e4\uc744 \uc704\ud55c \uc74c\uc545\ud68c\uc785\ub2c8\ub2e4.\n \u2463 \uc74c\uc545\ud68c\ub97c \ud55c \ud6c4\uc5d0 \ub2e4 \ud568\uaed8 \uc800\ub141\uc744 \uba39\uc744 \uac81\ub2c8\ub2e4.",n,6,"\u2460\u97f3\u697d\u4f1a\u306f\u5348\u5f8c4\u6642\u306b\u59cb\u307e\u308a\u307e\u3059\u3002\u2461\u4f1d\u7d71\u97f3\u697d\u3092\u5b66\u3093\u3067\u3044\u308b\u97d3\u56fd\u4eba\u5b66\u751f\u305f\u3061\u304c\u6f14\u594f\u3057\u307e\u3059\u3002\u2462\u3053\u306e\u516c\u6f14\u306f\u7559\u5b66\u751f\u306e\u305f\u3081\u306e\u97f3\u697d\u4f1a\u3067\u3059\u3002","\u2460 \uc74c\uc545\ud68c\ub294 \uc624\ud6c4 4\uc2dc\uc5d0 \uc2dc\uc791\ud560 \uac81\ub2c8\ub2e4. \u2461 \uc804\ud1b5 \uc74c\uc545\uc744 \uacf5\ubd80\ud558\ub294 \ud55c\uad6d \ud559\uc0dd\ub4e4\uc774 \uc5f0\uc8fc\ud560 \uac81\ub2c8\ub2e4. \u2462 \uc774 \uacf5\uc5f0\uc740 \uc720\ud559\uc0dd\uc744 \uc704\ud55c \uc74c\uc545\ud68c\uc785\ub2c8\ub2e4.","\u2460 Konser bermula dari 4 pm. \u2461 Pelajar yang belajar muzik tradisional akan membuat persembahan.\u2462 Konsert muzik tersebut diadakan untuk pelajar luar negara.",q,k,"64. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810).",l,n),A.l("\u2460 \uc801\uc5b4 \ubd05\ub2c8\ub2e4","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u062d\u062f\u062b \u0639\u0646 \u0627\u0644\u0645\u0644\u0627\u062d\u0638\u0627\u062a \u0627\u0644\u062a\u064a \u064a\u0643\u062a\u0628\u0647\u0627 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645. \u064a\u0643\u062a\u0628 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 \u062b\u0644\u0627\u062b\u0629 \u0623\u0634\u064a\u0627\u0621 \u062c\u064a\u062f\u0629 \u0642\u0627\u0645 \u0628\u0647\u0627. \u0648\u064a\u0643\u062a\u0628 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0627\u0644\u062a\u064a \u0633\u064a\u0642\u0648\u0645 \u0628\u0647\u0627 \u063a\u062f\u0627. \u0644\u0623\u0646\u0647 \u064a\u0633\u062a\u0637\u064a\u0639 \u0647\u0643\u0630\u0627 \u062a\u0631\u062a\u064a\u0628 \u064a\u0648\u0645\u0647 \u0623\u0643\u062b\u0631","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u8fd9\u4e2a\u4eba\u7761\u524d\u5199\u7684\u5907\u5fd8\u5f55\u3002 \u8fd9\u4e2a\u4eba\u5728\u7761\u89c9\u524d\u5199\u4e0b\u4ed6\u505a\u5f97\u597d\u7684\u4e09\u4ef6\u4e8b\u3002 \u5e76\u5199\u4e0b\u660e\u5929\u8981\u505a\u4ec0\u4e48\u3002 \u56e0\u4e3a\u8fd9\u5c06\u5e2e\u52a9\u4ed6\u66f4\u597d\u5730\u5b89\u6392\u4e00\u5929\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u9019\u500b\u4eba\u7761\u524d\u5beb\u7684\u5099\u5fd8\u9304\u3002\u9019\u500b\u4eba\u5728\u7761\u89ba\u524d\u5beb\u4e0b\u4ed6\u505a\u5f97\u597d\u7684\u4e09\u4ef6\u4e8b\u3002\u4e26\u5beb\u4e0b\u660e\u5929\u8981\u505a\u4ec0\u9ebc\u3002\u56e0\u70ba\u9019\u5c07\u5e6b\u52a9\u4ed6\u66f4\u597d\u5730\u5b89\u6392\u4e00\u5929\u3002","This text is about the memo which this person writes before bed. Before bed, he writes down what he did well today and what he will do tomorrow. That's because he can organize his days more efficiently. "," \u2460 \uc801\uc5b4 \ubd05\ub2c8\ub2e4\n \u2461 \uc801\uac8c \ub429\ub2c8\ub2e4\n \u2462 \uc801\uc744\uae4c \ud569\ub2c8\ub2e4\n \u2463 \uc801\uc744 \uac83 \uac19\uc2b5\ub2c8\ub2e4",n,7,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u3053\u306e\u4eba\u304c\u5bdd\u308b\u524d\u306b\u66f8\u3044\u3066\u3044\u308b\u30e1\u30e2\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u4eba\u306f\u5bdd\u308b\u524d\u306b\u305d\u306e\u65e5\u3088\u304f\u3067\u304d\u305f\u3053\u3068\u30923\u3064\u66f8\u304d\u307e\u3059\u3002\u305d\u3057\u3066\u7fcc\u65e5\u3059\u308b\u3053\u3068\u3092\u66f8\u3044\u3066\u307f\u307e\u3059\u3002\u305d\u3046\u3059\u308b\u3068\u4e00\u65e5\u3092\u3088\u308a\u304d\u3061\u3093\u3068\u6574\u7406\u3067\u304d\u308b\u304b\u3089\u3067\u3059\u3002","\uc774 \uae00\uc740 \uc774 \uc0ac\ub78c\uc774 \uc790\uae30 \uc804\uc5d0 \uc4f0\ub294 \uba54\ubaa8\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \uc790\uae30 \uc804\uc5d0 \uc798 \ud55c \uc77c \uc138 \uac00\uc9c0\ub97c \uc501\ub2c8\ub2e4. \uadf8\ub9ac\uace0 \ub0b4\uc77c \ud560 \uc77c\uc744 \uc801\uc5b4 \ubd05\ub2c8\ub2e4. \uc774\ub807\uac8c \ud558\uba74 \ud558\ub8e8\ub97c \ub354 \uc798 \uc815\ub9ac\ud560 \uc218 \uc788\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4.","Petikan tersebut adalah memo yang dituliskan oleh seseorang sebelum tidur. Dia menyenaraikan apa-apa yang telah dibuatkan sebelum tidur.Dia juga menyenaraikan hal yang perlu dibuat pada esok.Dengan ini,dia berasa masanya boleh diatur dengan lebih baik.",q,n,"65. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",j,i),A.l("\u2463 \uba54\ubaa8\ub97c \ud558\uba74\uc11c \ud558\ub8e8\uc758 \uc77c\uc744 \uc0dd\uac01\ud569\ub2c8\ub2e4.","1- \u064a\u0631\u062a\u0628 \u064a\u0648\u0645\u0647 \u0628\u0643\u062a\u0627\u0628\u0629 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0627\u0644\u062c\u064a\u062f\u0629 \u0627\u0644\u062a\u064a \u0641\u0639\u0644\u0647\u0627 2- \u064a\u0643\u062a\u0628 \u0645\u0627 \u0633\u064a\u0641\u0639\u0644\u0647 \u063a\u062f\u0627 \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 3- \u064a\u0643\u062a\u0628 \u0645\u0644\u0627\u062d\u0638\u0627\u062a \u0642\u0628\u0644 \u0627\u0644\u0646\u0648\u0645 \u0643\u064a \u0644\u0627 \u064a\u0646\u0633\u0649 \u0627\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u0645\u0647\u0645\u0629","\u2460 \u5199\u4e0b\u5f53\u5929\u505a\u5f97\u597d\u7684\u5730\u65b9\u5e76\u6574\u7406\u8d77\u6765\u3002 \u2461 \u7761\u524d\u5199\u4e0b\u660e\u5929\u60f3\u505a\u4ec0\u4e48\u3002 \u2462 \u7761\u524d\u505a\u7b14\u8bb0\uff0c\u4ee5\u514d\u5fd8\u8bb0\u91cd\u8981\u7684\u4e8b\u60c5\u3002","\u2460 \u5beb\u4e0b\u7576\u5929\u505a\u5f97\u597d\u7684\u5730\u65b9\u4e26\u6574\u7406\u8d77\u4f86\u3002 \u2461 \u7761\u524d\u5beb\u4e0b\u660e\u5929\u60f3\u505a\u4ec0\u9ebc\u3002 \u2462 \u7761\u524d\u505a\u7b46\u8a18\uff0c\u4ee5\u514d\u5fd8\u8a18\u91cd\u8981\u7684\u4e8b\u60c5\u3002","\u2460 This person organizes what he did well that day. \u2461 This person writes what he will do tomorrow before bed. \u2462 This person take a memo before bed not to forget important things."," \u2460 \ud558\ub8e8\uc758 \uc798\ubabb\ud55c \uc77c\uc744 \uc368\uc11c \uc815\ub9ac\ud569\ub2c8\ub2e4.\n \u2461 \uc544\uce68\uc5d0 \uc77c\uc5b4\ub098\uc11c \uc624\ub298 \ud560 \uc77c\uc744 \uc501\ub2c8\ub2e4.\n \u2462 \uc78a\uc5b4\ubc84\ub9b0 \uc77c\ub4e4\uc740 \uc790\uae30 \uc804\uc5d0 \uba54\ubaa8\ud569\ub2c8\ub2e4.\n \u2463 \uba54\ubaa8\ub97c \ud558\uba74\uc11c \ud558\ub8e8\uc758 \uc77c\uc744 \uc0dd\uac01\ud569\ub2c8\ub2e4.",n,8,"\u2460\u4e00\u65e5\u306e\u3088\u304f\u3067\u304d\u305f\u3053\u3068\u3092\u66f8\u3044\u3066\u6574\u7406\u3057\u307e\u3059\u3002\u2461\u5bdd\u308b\u524d\u306b\u7fcc\u65e5\u3084\u308b\u3053\u3068\u3092\u66f8\u304d\u307e\u3059\u3002\u2462\u91cd\u8981\u306a\u3053\u3068\u3092\u5fd8\u308c\u306a\u3044\u3088\u3046\u306b\u5bdd\u308b\u524d\u306b\u30e1\u30e2\u3057\u307e\u3059\u3002","\u2460 \ud558\ub8e8\uc758 \uc798 \ud55c \uc77c\uc744 \uc368\uc11c \uc815\ub9ac\ud569\ub2c8\ub2e4. \u2461 \uc790\uae30 \uc804\uc5d0 \ub0b4\uc77c \ud560 \uc77c\uc744 \uc501\ub2c8\ub2e4. \u2462 \uc911\uc694\ud55c \uc77c\uc744 \uc78a\uc5b4\ubc84\ub9ac\uc9c0 \uc54a\uae30 \uc704\ud574\uc11c \uc790\uae30 \uc804\uc5d0 \uba54\ubaa8\ud569\ub2c8\ub2e4.","\u2460 Orang tersebut menyenaraikan hal yang disiapkan dengan baik pada hari ini.\u2461 Orang tersebut menyenaraikan hal yang perlu dibuat sebelum tidur. \u2462 Orang tersebut menyenaraikan hal penting di kertas supaya dia tidak berlupa pada hari esok.",q,n,"66. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",j,i),A.l("\u2463 \ubb3c\uc774 \ube68\ub9ac \uc5c6\uc5b4\uc9c0\ub294 \uac83\uc744","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u062d\u062f\u062b \u0639\u0646 \u0643\u064a\u0641\u064a\u0629 \u0627\u0644\u0627\u0647\u062a\u0645\u0627\u0645 \u0628\u0627\u0644\u0623\u0632\u0647\u0627\u0631 \u0648\u0627\u0644\u0623\u0634\u062c\u0627\u0631. \u0644\u0627 \u064a\u062c\u0628 \u0623\u0646 \u064a\u0646\u0632\u0644 \u0627\u0644\u0645\u0627\u0621 \u0645\u0646 \u0627\u0644\u0623\u0635\u064a\u0635 \u0628\u0633\u0631\u0639\u0629. \u0644\u0630\u0644\u0643 \u064a\u062c\u0628 \u0648\u0636\u0639 \u0627\u0644\u0623\u0635\u0635 \u0641\u064a \u0645\u0643\u0627\u0646 \u0648\u0627\u062d\u062f \u0623\u0648 \u0648\u0636\u0639 \u0641\u0648\u0637\u0629 \u0645\u0628\u0644\u0644\u0629 \u062a\u062d\u062a \u0627\u0644\u0623\u0635\u064a\u0635","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u5982\u4f55\u7167\u987e\u82b1\u8349\u6811\u6728\u7684\u3002 \u82b1\u76c6\u91cc\u7684\u7684\u6c34\u4e0d\u80fd\u5f88\u5feb\u7528\u5b8c\u3002 \u8fd9\u5c31\u662f\u4e3a\u4ec0\u4e48\u5c06\u82b1\u76c6\u653e\u5728\u4e00\u8d77\u6216\u5728\u82b1\u76c6\u4e0b\u9762\u653e\u4e00\u6761\u6e7f\u6bdb\u5dfe\u4f1a\u66f4\u597d\u7684\u539f\u56e0\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u5982\u4f55\u7167\u9867\u82b1\u8349\u6a39\u6728\u7684\u3002\u82b1\u76c6\u88e1\u7684\u7684\u6c34\u4e0d\u80fd\u5f88\u5feb\u7528\u5b8c\u3002\u9019\u5c31\u662f\u70ba\u4ec0\u9ebc\u5c07\u82b1\u76c6\u653e\u5728\u4e00\u8d77\u6216\u5728\u82b1\u76c6\u4e0b\u9762\u653e\u4e00\u689d\u6fd5\u6bdb\u5dfe\u6703\u66f4\u597d\u7684\u539f\u56e0\u3002","This text is about how to manage flowers and trees. Flowerpots should not get dry too fast. So, it is good to put them together or to put wet towels under them."," \u2460 \ud587\ube5b\uc744 \ubcf4\ub294 \uac83\uc744\n \u2461 \uacf5\uae30\uac00 \ub4e4\uc5b4\uc624\ub294 \uac83\uc744\n \u2462 \ud654\ubd84\uc5d0 \uaf43\uc774 \ud53c\ub294 \uac83\uc744\n \u2463 \ubb3c\uc774 \ube68\ub9ac \uc5c6\uc5b4\uc9c0\ub294 \uac83\uc744",n,9,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u82b1\u3068\u6728\u306e\u7ba1\u7406\u65b9\u6cd5\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u690d\u6728\u9262\u306f\u6c34\u304c\u65e9\u304f\u7121\u304f\u306a\u3063\u3066\u306f\u3044\u3051\u307e\u305b\u3093\u3002\u3060\u304b\u3089\u690d\u6728\u9262\u3092\u4e00\u304b\u6240\u306b\u96c6\u3081\u3066\u7f6e\u3044\u305f\u308a\u3001\u6fe1\u308c\u305f\u30bf\u30aa\u30eb\u3092\u690d\u6728\u9262\u306e\u4e0b\u306b\u7f6e\u304f\u3068\u826f\u3044\u3067\u3059\u3002","\uc774 \uae00\uc740 \uaf43\uacfc \ub098\ubb34\uc758 \uad00\ub9ac \ubc29\ubc95\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \ud654\ubd84\uc5d0\ub294 \ubb3c\uc774 \ube68\ub9ac \uc5c6\uc5b4\uc9c0\uba74 \uc548 \ub429\ub2c8\ub2e4. \uadf8\ub798\uc11c \ud654\ubd84\uc744 \ud55c\uacf3\uc5d0 \ubaa8\uc544 \ub193\uac70\ub098 \uc816\uc740 \uc218\uac74\uc744 \ud654\ubd84 \uc544\ub798\uc5d0 \ub193\uc73c\uba74 \uc88b\uc2b5\ub2c8\ub2e4.","Petikan tersebut berbincang tentang cara-cara menjaga bunga dan pokok.Dalam palsu bunga,air perlu selalu diisikan. Jadi,mengumpulkan semua palsu bunga di satu tempat atau meletakkan tuala basah di bawah palsu bunga adalah cara yang baik.",q,n,"67. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",h,g),A.l("\u2462 \ubc29\ubb38\uc744 \uc5f4\uc5b4\uc11c \uacf5\uae30\uac00 \ud1b5\ud558\uac8c \ud574\uc57c \ud569\ub2c8\ub2e4.","1- \u064a\u062c\u0628 \u0648\u0636\u0639 \u0641\u0648\u0637\u0629 \u0645\u0628\u0644\u0644\u0629 \u0628\u0627\u0644\u0645\u0627\u0621 \u062a\u062d\u062a \u0627\u0644\u0623\u0635\u064a\u0635 2- \u064a\u062c\u0628 \u0648\u0636\u0639 \u0627\u0644\u0623\u0635\u0635 \u0641\u064a \u0645\u0643\u0627\u0646 \u0648\u0627\u062d\u062f 4- \u064a\u062c\u0628 \u0648\u0636\u0639 \u0627\u0644\u0623\u0635\u064a\u0635 \u0641\u064a \u0645\u0643\u0627\u0646 \u0644\u064a\u0633 \u0641\u064a\u0647 \u0623\u0634\u0639\u0629 \u0634\u0645\u0633","\u2460 \u5728\u82b1\u76c6\u4e0b\u9762\u653e\u4e00\u6761\u6e7f\u6bdb\u5dfe\u3002 \u2461 \u82b1\u76c6\u5e94\u96c6\u4e2d\u5728\u4e00\u5904\u3002 \u2463 \u65c5\u884c\u524d\uff0c\u5e94\u5c06\u82b1\u76c6\u653e\u5728\u9633\u5149\u4e0d\u5145\u8db3\u7684\u5730\u65b9\u3002","\u2460 \u5728\u82b1\u76c6\u4e0b\u9762\u653e\u4e00\u689d\u6fd5\u6bdb\u5dfe\u3002 \u2461 \u82b1\u76c6\u61c9\u96c6\u4e2d\u5728\u4e00\u8655\u3002 \u2463 \u65c5\u884c\u524d\uff0c\u61c9\u5c07\u82b1\u76c6\u653e\u5728\u967d\u5149\u4e0d\u5145\u8db3\u7684\u5730\u65b9\u3002","\u2460 Wet towels should be put under flowerpots. \u2461 Flowerpots should put together. \u2463 Before traveling, flowerpots should left in a place where there's little sunlight."," \u2460 \uc218\uac74\uc744 \ud654\ubd84 \uc548\uc5d0 \ub123\uc5b4 \ub193\uc544\uc57c \ud569\ub2c8\ub2e4.\n \u2461 \ud654\ubd84\uc744 \uc5ec\ub7ec \ubc29\uc5d0 \ub098\ub204\uc5b4 \ub193\uc544\uc57c \ud569\ub2c8\ub2e4.\n \u2462 \ubc29\ubb38\uc744 \uc5f4\uc5b4\uc11c \uacf5\uae30\uac00 \ud1b5\ud558\uac8c \ud574\uc57c \ud569\ub2c8\ub2e4.\n \u2463 \uc5ec\ud589 \uc804\uc5d0\ub294 \ud654\ubd84\uc744 \ud587\ube5b\uc5d0 \ub193\uace0 \uac00\uc57c \ud569\ub2c8\ub2e4.",n,10,"\u2460\u6fe1\u308c\u305f\u30bf\u30aa\u30eb\u3092\u690d\u6728\u9262\u306e\u4e0b\u306b\u7f6e\u304b\u306a\u3051\u308c\u3070\u306a\u308a\u307e\u305b\u3093\u3002\u2461\u690d\u6728\u9262\u306f\u4e00\u304b\u6240\u306b\u96c6\u3081\u3066\u7f6e\u304b\u306a\u3051\u308c\u3070\u306a\u308a\u307e\u305b\u3093\u3002\u2463\u65c5\u884c\u524d\u306b\u306f\u690d\u6728\u9262\u3092\u65e5\u5149\u304c\u5f53\u305f\u3089\u306a\u3044\u6240\u306b\u7f6e\u3044\u3066\u884c\u304b\u306a\u3051\u308c\u3070\u306a\u308a\u307e\u305b\u3093\u3002","\u2460 \ubb3c\uc5d0 \uc816\uc740 \uc218\uac74\uc744 \ud654\ubd84 \uc544\ub798\uc5d0 \ub193\uc544\uc57c \ud569\ub2c8\ub2e4. \u2461 \ud654\ubd84\uc740 \ud55c\uacf3\uc5d0 \ubaa8\uc544 \ub193\uc544\uc57c \ud569\ub2c8\ub2e4. \u2463 \uc5ec\ud589 \uc804\uc5d0\ub294 \ud654\ubd84\uc744 \ud587\ube5b\uc774 \uc798 \ub4e4\uc5b4\uc624\uc9c0 \uc54a\ub294 \uacf3\uc5d0 \ub193\uace0 \uac00\uc57c \ud569\ub2c8\ub2e4. ","\u2460 Tuala yang basah perlu diletakkan di bawah palsu bunga. \u2461 Palsu bunga perlu dikumpulkan di satu tempat. \u2463 Sebelum pergi melancong, palsu bunga perlu dipindah ke tempat yang tidak mempunyai cahaya.",q,n,"68. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",h,g),A.l("\u2463 \ucc0d\uc744 \uc218 \uc788\uae30 \ub54c\ubb38\uc5d0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u062d\u062f\u062b \u0639\u0646 \u062a\u062c\u0631\u0628\u0629 \u0633\u062a\u0648\u062f\u064a\u0648 \u0627\u0644\u062a\u0635\u0648\u064a\u0631 \u0627\u0644\u0645\u0645\u064a\u0632\u0629 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635. \u064a\u0645\u0643\u0646 \u0627\u0633\u062a\u0626\u062c\u0627\u0631 \u0627\u0644\u0645\u0644\u0627\u0628\u0633 \u0648\u0648\u0636\u0639 \u0627\u0644\u0645\u0643\u064a\u0627\u062c \u0648\u062a\u0635\u0641\u064a\u0641 \u0627\u0644\u0634\u0639\u0631 \u0641\u064a\u0647.\u0633\u064a\u0642\u062f\u0645 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0630\u0644\u0643 \u0627\u0644\u0645\u0643\u0627\u0646 \u0644\u0623\u0635\u062f\u0642\u0627\u0621\u0647.\u0644\u0623\u0646\u0643 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0623\u062e\u0630 \u0635\u0648\u0631\u0627 \u062a\u0639\u062c\u0628\u0643 \u0641\u064a\u0647","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u8fd9\u4e2a\u4eba\u975e\u51e1\u7684\u7167\u76f8\u9986\u4f53\u9a8c\u3002 \u5728\u7167\u76f8\u9986\u91cc\uff0c\u53ef\u4ee5\u5316\u5986,\u505a\u5934\u53d1\uff0c\u8fd8\u53ef\u4ee5\u4ece\u7167\u76f8\u9986\u501f\u8863\u670d\u3002 \u4ed6\u4f1a\u5c06\u8fd9\u4e2a\u7167\u76f8\u9986\u4ecb\u7ecd\u7ed9\u4ed6\u7684\u670b\u53cb\u3002 \u56e0\u4e3a\u53ef\u4ee5\u62cd\u51fa\u559c\u6b22\u7684\u7167\u7247\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u9019\u500b\u4eba\u975e\u51e1\u7684\u7167\u76f8\u9928\u9ad4\u9a57\u3002\u5728\u7167\u76f8\u9928\u88e1\uff0c\u53ef\u4ee5\u5316\u599d,\u505a\u982d\u9aee\uff0c\u9084\u53ef\u4ee5\u5f9e\u7167\u76f8\u9928\u501f\u8863\u670d\u3002\u4ed6\u6703\u5c07\u9019\u500b\u7167\u76f8\u9928\u4ecb\u7d39\u7d66\u4ed6\u7684\u670b\u53cb\u3002\u56e0\u70ba\u53ef\u4ee5\u62cd\u51fa\u559c\u6b61\u7684\u7167\u7247\u3002","This text is about this person's experience of the special photo studio. Customers can put on makeup, have their hair set, and borrow some costumes. This person will introduce the shop to friends. That's because they can take photos they like."," \u2460 \ucc0d\uc744\uae4c \ud574\uc11c\n \u2461 \ucc0d\uc73c\ub824\uace0 \ud574\uc11c\n \u2462 \ucc0d\uc5b4\uc57c \ud558\uae30 \ub54c\ubb38\uc5d0\n \u2463 \ucc0d\uc744 \uc218 \uc788\uae30 \ub54c\ubb38\uc5d0",n,11,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u3053\u306e\u4eba\u306e\u7279\u5225\u306a\u5199\u771f\u9928\u3067\u306e\u7d4c\u9a13\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u305d\u306e\u5199\u771f\u9928\u3067\u306f\u5316\u7ca7\u3084\u9aea\u3082\u6574\u3048\u3066\u3082\u3089\u3048\u3001\u670d\u3082\u501f\u308a\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u3053\u306e\u4eba\u306f\u53cb\u4eba\u305f\u3061\u306b\u3053\u306e\u5199\u771f\u9928\u3092\u7d39\u4ecb\u3059\u308b\u3064\u3082\u308a\u3067\u3059\u3002\u6c17\u306b\u5165\u3063\u305f\u5199\u771f\u3092\u64ae\u308b\u3053\u3068\u304c\u3067\u304d\u305f\u304b\u3089\u3067\u3059\u3002","\uc774 \uae00\uc740 \uc774 \uc0ac\ub78c\uc758 \ud2b9\ubcc4\ud55c \uc0ac\uc9c4\uad00 \uacbd\ud5d8\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uadf8 \uc0ac\uc9c4\uad00\uc5d0\uc11c \ud654\uc7a5\ub3c4 \ud558\uace0, \uba38\ub9ac\ub3c4 \ud558\uace0, \uc637\ub3c4 \ube4c\ub9b4 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \uce5c\uad6c\ub4e4\uc5d0\uac8c \uadf8 \uc0ac\uc9c4\uad00\uc744 \uc18c\uac1c\ud560 \uac81\ub2c8\ub2e4. \ub9c8\uc74c\uc5d0 \ub4dc\ub294 \uc0ac\uc9c4\uc744 \ucc0d\uc744 \uc218 \uc788\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang pengalaman seseorang pergi ke studio gambar yang unik.Pelanggan yang datang ke sana boleh menyolek dan membuat rambuat dan juga meminjam kostum di sana.Orang tersebut yang memperkenalkan studio tersebut kepada kawannya.Hal ini disebabkan gambar yang cantik boleh diambil di sana..",q,n,"69. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",f,e),A.l("\u2462 \uc190\ub2d8\uc740 \ud2b9\ubcc4\ud55c \uc900\ube44 \uc5c6\uc774 \uc0ac\uc9c4\uad00\uc5d0 \uac00\ub3c4 \ub429\ub2c8\ub2e4.","1- \u0643\u0644 \u0627\u0644\u062a\u062c\u0647\u064a\u0632\u0627\u062a \u0627\u0644\u0644\u0627\u0632\u0645\u0629 \u0644\u0644\u062a\u0635\u0648\u064a\u0631 \u0645\u0648\u062c\u0648\u062f\u0629 \u0641\u064a \u0627\u0644\u0627\u0633\u062a\u0648\u062f\u064a\u0648 2- \u064a\u0645\u0643\u0646 \u0623\u062e\u0630 \u0635\u0648\u0631 \u062a\u0639\u062c\u0628\u0643 \u0641\u064a \u0627\u0644\u0627\u0633\u062a\u0648\u062f\u064a\u0648 4- \u064a\u0645\u0643\u0646 \u062a\u062c\u0647\u064a\u0632 \u0646\u0641\u0633\u0643 \u0648\u0627\u0644\u062a\u0642\u0627\u0637 \u0627\u0644\u0635\u0648\u0631 \u0641\u064a \u0627\u0644\u0627\u0633\u062a\u0648\u062f\u064a\u0648","\u2460 \u7167\u76f8\u9986\u91cc\u51c6\u5907\u62cd\u7167\u7684\u7269\u54c1\u4e00\u5e94\u4ff1\u5168\u3002 \u2461 \u53ef\u4ee5\u5728\u7167\u76f8\u9986\u62cd\u6444\u81ea\u5df1\u559c\u6b22\u7684\u7167\u7247\u3002 \u2463 \u53ef\u4ee5\u5728\u7167\u76f8\u9986\u51c6\u5907\u548c\u62cd\u7167\u3002","\u2460 \u7167\u76f8\u9928\u88e1\u6e96\u5099\u62cd\u7167\u7684\u7269\u54c1\u4e00\u61c9\u4ff1\u5168\u3002 \u2461 \u53ef\u4ee5\u5728\u7167\u76f8\u9928\u62cd\u651d\u81ea\u5df1\u559c\u6b61\u7684\u7167\u7247\u3002 \u2463 \u53ef\u4ee5\u5728\u7167\u76f8\u9928\u6e96\u5099\u548c\u62cd\u7167\u3002","\u2460 This photo studio is all set to take photos \u2461 Customers can take photos they like in the photo studio. \u2463 Customers can have themselves set and take photos in the photo studio."," \u2460 \uc0ac\uc9c4\uad00\uc5d0\uc11c \uc0ac\uc9c4 \ucc0d\ub294 \ubc29\ubc95\uc744 \ubc30\uc6b8 \uc218 \uc788\uc2b5\ub2c8\ub2e4.\n \u2461 \uc0ac\uc9c4\uc774 \ub9c8\uc74c\uc5d0 \ub4e4\uc9c0 \uc54a\uc73c\uba74 \ub2e4\uc2dc \ucc0d\uc5b4\ub3c4 \ub429\ub2c8\ub2e4.\n \u2462 \uc190\ub2d8\uc740 \ud2b9\ubcc4\ud55c \uc900\ube44 \uc5c6\uc774 \uc0ac\uc9c4\uad00\uc5d0 \uac00\ub3c4 \ub429\ub2c8\ub2e4.\n \u2463 \uc190\ub2d8\uc740 \uae30\ub2e4\ub9ac\uc9c0 \uc54a\uace0 \uc0ac\uc9c4\uc744 \ucc0d\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.",n,12,"\u2460\u5199\u771f\u9928\u3067\u306f\u5199\u771f\u3092\u64ae\u308b\u305f\u3081\u306e\u3059\u3079\u3066\u306e\u6e96\u5099\u304c\u3055\u308c\u3066\u3044\u307e\u3059\u3002\u2461\u5199\u771f\u9928\u3067\u306f\u6c17\u306b\u5165\u3063\u305f\u5199\u771f\u3092\u64ae\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u2463\u5199\u771f\u9928\u3067\u306f\u6e96\u5099\u3057\u3066\u304b\u3089\u5199\u771f\u3092\u64ae\u308b\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002","\u2460 \uc0ac\uc9c4\uad00\uc5d0\ub294 \uc0ac\uc9c4\uc744 \ucc0d\uae30 \uc704\ud55c \uc900\ube44\uac00 \ub2e4 \ub418\uc5b4 \uc788\uc2b5\ub2c8\ub2e4. \u2461 \uc0ac\uc9c4\uad00\uc5d0\uc11c \ub9c8\uc74c\uc5d0 \ub4dc\ub294 \uc0ac\uc9c4\uc744 \ucc0d\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \u2463 \uc0ac\uc9c4\uad00\uc5d0\uc11c \uc900\ube44\ud558\uace0 \uc0ac\uc9c4\uc744 \ucc0d\uc744 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","\u2460 Studio gamber tersebut disediakan untuk mengambil gambar. \u2461 Pelanggan boleh mengam il gambar yang sukar di studio gambar tersebut. \u2463 Pelanggan bileh menyolek di studio gambar tersebut sebelum mengambil gambar.",q,n,"70. \uc774 \uae00\uc758 \ub0b4\uc6a9\uc73c\ub85c \uc54c \uc218 \uc788\ub294 \uac83\uc740 \ubb34\uc5c7\uc785\ub2c8\uae4c? (3\uc810)",f,e)],t.p)})
