r($,"aYK","aGS",()=>{var q="\uc720\ud615 8",p="\u203b [59~60] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",o=" \uc800\ub294 \ud53c\uc544\ub178 \ud559\uc6d0\uc5d0 \ub2e4\ub2cc \uc9c0 3\ub144\uc774 \ub418\uc5c8\uc2b5\ub2c8\ub2e4. ( \u3260 ) \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4. ( \u3261 ) \ud53c\uc544\ub178\ub97c \uce58\uba74\uc11c \uc88b\uc544\ud558\ub294 \uac00\uc218\uc758 \ub178\ub798\ub97c \ubd80\ub974\uba74 \uc815\ub9d0 \uc990\uac70\uc6cc\uc9d1\ub2c8\ub2e4. ( \u3262 ) \ud53c\uc544\ub178\ub97c \ubc30\uc6b0\ub294 \uac83\uc774 \uc815\ub9d0 \uc88b\uc2b5\ub2c8\ub2e4. ( \u3263 ) ",n=null,m="\u203b [61~62] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",l=" \uc800\ub294 \uc870\uae08 \uc804\uc5d0 \ud154\ub808\ube44\uc804\uc744 \ubcf4\uace0 \uae5c\uc9dd \ub180\ub790\uc2b5\ub2c8\ub2e4. \ud154\ub808\ube44\uc804\uc5d0 \uc81c \ub3d9\uc0dd\uc774 \ud06c\uac8c \ub098\uc654\uae30 \ub54c\ubb38\uc785\ub2c8\ub2e4. \ub3d9\uc0dd\uc740 \ud14c\ub2c8\uc2a4 \uacbd\uae30\uc7a5\uc5d0\uc11c \uacbd\uae30\ub97c \ubcf4\uace0 \uc788\uc5c8\ub294\ub370 \ubc15\uc218\ub97c \uce58\uba74\uc11c \uc6c3\uace0 \uc788\uc5c8\uc2b5\ub2c8\ub2e4. \ub3d9\uc0dd\uc758 \ubaa8\uc2b5\uc744 \ud154\ub808\ube44\uc804\uc5d0\uc11c \ubcf8 \uac83\uc740 \ucc98\uc74c\uc774\uc5c8\uc2b5\ub2c8\ub2e4. \ub9e4\uc77c \ubcf4\ub294 \ub3d9\uc0dd\uc774\uc9c0\ub9cc \ub3d9\uc0dd\uc758 \uc5bc\uad74\uc744 \ud154\ub808\ube44\uc804\uc5d0\uc11c \ubcf4\ub2c8\uae4c ( \u3260 ) \uc0c8\ub85c\uc6b4 \uae30\ubd84\uc774 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. ",k="\u203b [63~64] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",j="assets/images/646364.png",i="\u203b [65~66] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",h=" \uc5bc\uc74c \uc74c\ub8cc\ub294 \uc5ec\ub984\ucca0 \uc778\uae30 \uba54\ub274\uc785\ub2c8\ub2e4. \uadf8\ub7f0\ub370 \uc5bc\uc74c\uc774 \ub179\uc544\uc11c \ubb3c\uc774 \ub418\uba74 \uc74c\ub8cc\uc758 \ub9db\uc774 \uc5c6\uc5b4\uc9d1\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc5bc\uc74c \uc74c\ub8cc\ub97c \ub9cc\ub4e4 \ub54c\ub294 \ucc9c\ucc9c\ud788 \ub179\ub294 \uc5bc\uc74c\uc744 \ub123\uc73c\uba74 \uc88b\uc2b5\ub2c8\ub2e4. \ud070 \uc5bc\uc74c\uc740 \uc791\uc740 \uc5bc\uc74c\ubcf4\ub2e4 \ucc9c\ucc9c\ud788 \ub179\uace0, \uc624\ub798 \uc5bc\ub9b0 \uc5bc\uc74c\ub3c4 \uc7a0\uae50 \uc5bc\ub9b0 \uc5bc\uc74c\ubcf4\ub2e4 \ucc9c\ucc9c\ud788 \ub179\uc2b5\ub2c8\ub2e4. \uc774\ub7f0 \uc5bc\uc74c\uc744 \ub123\uc73c\uba74 ( \u3260 ) \ucc98\uc74c \uc74c\ub8cc\uc758 \ub9db\uc744 \uc624\ub798 \uc990\uae38 \uc218 \uc788\uc2b5\ub2c8\ub2e4. ",g="\u203b [67~68] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",f=" \ud0dc\ud48d\uc740 \ubcf4\ud1b5 7\uc6d4\ubd80\ud130 9\uc6d4\uae4c\uc9c0 \ub9ce\uc774 \uc0dd\uae41\ub2c8\ub2e4. \uc774\ub7f0 \ud0dc\ud48d\ub4e4\ub3c4 \uc774\ub984\uc774 \uc788\ub294\ub370 \uadf8 \uc911\uc5d0\ub294 \ud55c\uad6d\uc5b4\ub85c \ub41c \uc774\ub984\ub3c4 \uc788\uc2b5\ub2c8\ub2e4. \ud0dc\ud48d\uc758 \uc774\ub984\uc740 \ud0dc\ud48d\uc774 \uc9c0\ub098\uac00\ub294 \uacf3\uc5d0 \uc788\ub294 \uc5f4\ub124 \uac1c \ub098\ub77c\uc5d0\uc11c \ub9cc\ub4e4\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ud55c\uad6d\ub3c4 2000\ub144\ubd80\ud130 \ud0dc\ud48d\uc758 \uc774\ub984\uc744 ( \u3260 ). \ud55c\uad6d\uc5b4\ub85c \uc774\ub984\uc744 \ub9cc\ub4e4 \ub54c\ub294 \ub2e4\ub978 \ub098\ub77c \uc0ac\ub78c\ub4e4\ub3c4 \ubc1c\uc74c\ud558\uae30 \uc26c\uc6b4 \ub2e8\uc5b4\ub97c \uace0\ub985\ub2c8\ub2e4. ",e="\u203b [69~70] \ub2e4\uc74c\uc744 \uc77d\uace0 \ubb3c\uc74c\uc5d0 \ub2f5\ud558\uc2ed\uc2dc\uc624.",d=" \uba87 \ub2ec \uc804, \uc6b0\ub9ac \uc9d1 \uc55e\uc5d0\uc11c \ub5a8\uace0 \uc788\ub294 \uc791\uace0 \ub9c8\ub978 \uac15\uc544\uc9c0\ub97c \ubcf4\uc558\uc2b5\ub2c8\ub2e4. \uc800\ub294 \uadf8 \uac15\uc544\uc9c0\uac00 \ub108\ubb34 \ubd88\uc30d\ud574 \ubcf4\uc600\uc2b5\ub2c8\ub2e4. \uc800\ub294 \uac15\uc544\uc9c0\ub97c \uc9d1\uc73c\ub85c \ub370\ub824\uc640 \uba39\uc744 \uac83\uc744 \uc8fc\uace0 \uc7a0\ub3c4 \uc7ac\uc6cc \uc8fc\uc5c8\uc2b5\ub2c8\ub2e4. \uadf8\ub54c\ubd80\ud130 \uc8fc\uc778\uc744 \ucc3e\uace0 \uc788\ub294\ub370 \uc544\uc9c1\ub3c4 \uc8fc\uc778\uc774 \ub098\ud0c0\ub098\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4. \uadf8 \uac15\uc544\uc9c0\ub294 \uc774\uc81c ( \u3260 ) \uc800\uc758 \uc88b\uc740 \uce5c\uad6c\uac00 \ub418\uc5c8\uc2b5\ub2c8\ub2e4. \uac15\uc544\uc9c0\uc640 \ud5e4\uc5b4\uc9c0\uae30 \uc2eb\uc2b5\ub2c8\ub2e4. "
return A.a([A.l("\u2460 \u3260","\u064a\u062a\u0643\u0644\u0645 \u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u0639\u0646 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0630\u064a \u064a\u062a\u0639\u0644\u0645 \u0639\u0632\u0641 \u0627\u0644\u0628\u064a\u0627\u0646\u0648.\u064a\u0644\u062a\u062d\u0642 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0628\u0645\u0639\u0647\u062f \u0628\u064a\u0627\u0646\u0648.\u0641\u064a \u0627\u0644\u0628\u062f\u0627\u064a\u0629 \u0644\u0645 \u064a\u0639\u0632\u0641 \u062c\u064a\u062f\u0627 \u0644\u0643\u0646\u0647 \u064a\u0639\u0632\u0641 \u062c\u064a\u062f\u0627 \u0627\u0644\u0622\u0646. \u0644\u0630\u0644\u0643 \u064a\u0643\u0648\u0646 \u0627\u0644\u062a\u0631\u062a\u064a\u0628 \u0643\u0627\u0644\u062a\u0627\u0644\u064a [\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.]","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u8fd9\u4e2a\u4eba\u5b66\u4e60\u5f39\u94a2\u7434\u7684\u3002\u8fd9\u4e2a\u4eba\u73b0\u5728\u5728\u94a2\u7434\u5b66\u9662\u5b66\u5f39\u94a2\u7434\u3002\u4e00\u5f00\u59cb\u5f39\u5f97\u4e0d\u597d\uff0c\u4f46\u73b0\u5728\u5f39\u5f97\u5f88\u597d\u3002\u6240\u4ee5\u5b83\u7684\u987a\u5e8f\u662f [\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.]\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u9019\u500b\u4eba\u5b78\u7fd2\u5f48\u92fc\u7434\u7684\u3002\u9019\u500b\u4eba\u73fe\u5728\u5728\u92fc\u7434\u5b78\u9662\u5b78\u5f48\u92fc\u7434\u3002\u4e00\u958b\u59cb\u5f48\u5f97\u4e0d\u597d\uff0c\u4f46\u73fe\u5728\u5f48\u5f97\u5f88\u597d\u3002\u6240\u4ee5\u5b83\u7684\u9806\u5e8f\u662f [\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.]\u3002","This text is about this person's learning how to play the piano. This person goes to piano academy. At first, this person was not good at playing the piano but now plays well. So, This is the correct order. [\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.]"," \u2460 \u3260\n \u2461 \u3261\n \u2462 \u3262\n \u2463 \u3263"," \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. ",1,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u3053\u306e\u4eba\u304c\u30d4\u30a2\u30ce\u3092\u5b66\u3076\u3053\u3068\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u4eba\u306f\u30d4\u30a2\u30ce\u6559\u5ba4\u306b\u901a\u3063\u3066\u3044\u307e\u3059\u3002\u6700\u521d\u306f\u30d4\u30a2\u30ce\u3092\u5f3e\u3051\u307e\u305b\u3093\u3067\u3057\u305f\u304c\u3001\u4eca\u306f\u4e0a\u624b\u306b\u5f3e\u3051\u307e\u3059\u3002\u3057\u305f\u304c\u3063\u3066[\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4.(\u6700\u521d\u306f\u30d4\u30a2\u30ce\u304c\u5168\u304f\u5f3e\u3051\u307e\u305b\u3093\u3067\u3057\u305f) \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.(\u3067\u3082\u4eca\u306f\u3044\u304f\u3064\u304b\u66f2\u3092\u5f3e\u3051\u308b\u3088\u3046\u306b\u306a\u308a\u307e\u3057\u305f)]\u306e\u9806\u5e8f\u3067\u3059\u3002","\uc774 \uae00\uc740 \uc774 \uc0ac\ub78c\uc774 \ud53c\uc544\ub178\ub97c \ubc30\uc6b0\ub294 \uac83\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \ud53c\uc544\ub178 \ud559\uc6d0\uc5d0 \ub2e4\ub2c8\uace0 \uc788\uc2b5\ub2c8\ub2e4. \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc798 \ubabb \ucce4\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc798 \uce69\ub2c8\ub2e4. \uadf8\ub798\uc11c [\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.] \uc21c\uc11c\uc785\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang bagaimana orang tersebut belajar piano.Orang tersebut pergi ke pusat akademi piano.Pada mula-mulanya,dia tidak dapat bermain piano dengan baik tetapi dia menjadi pandai sekrang.Susunan yang betul ialah [\u3260 \ucc98\uc74c\uc5d0\ub294 \ud53c\uc544\ub178\ub97c \uc804\ud600 \uce58\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2192 \uadf8\ub807\uc9c0\ub9cc \uc9c0\uae08\uc740 \uc5ec\ub7ec \ub178\ub798\ub4e4\uc744 \uc798 \uce60 \uc218 \uc788\uac8c \ub418\uc5c8\uc2b5\ub2c8\ub2e4.]  ",q,n,"59. \ub2e4\uc74c \ubb38\uc7a5\uc774 \ub4e4\uc5b4\uac08 \uacf3\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",p,o),A.l("\u2460 \uc800\ub294 \ud53c\uc544\ub178\ub97c \ubc30\uc6b0\ub7ec \ub2e4\ub2d9\ub2c8\ub2e4.","2- \u064a\u062d\u0628 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u062a\u0639\u0644\u0645 \u0639\u0632\u0641 \u0627\u0644\u0628\u064a\u0627\u0646\u0648 3- \u064a\u0633\u062a\u0645\u062a\u0639 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0628\u0627\u0644\u063a\u0646\u0627\u0621 \u0645\u0639 \u0639\u0632\u0641 \u0627\u0644\u0628\u064a\u0627\u0646\u0648 4- \u064a\u062a\u0639\u0644\u0645 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0639\u0632\u0641 \u0627\u0644\u0628\u064a\u0627\u0646\u0648 \u0641\u064a \u0627\u0644\u0645\u0639\u0647\u062f \u0645\u0646\u0630 \u062b\u0644\u0627\u062b \u0633\u0646\u0648\u0627\u062a","\u2461 \u8fd9\u4e2a\u4eba\u559c\u6b22\u5b66\u94a2\u7434\u3002 \u2462 \u8fd9\u4e2a\u4eba\u4e00\u8fb9\u5f39\u94a2\u7434\u4e00\u8fb9\u559c\u6b22\u5531\u6b4c\u3002 \u2463 \u8fd9\u4e2a\u4eba\u5728\u5b66\u9662\u5b66\u4e60\u94a2\u7434\u4e09\u5e74\u3002","\u2461 \u9019\u500b\u4eba\u559c\u6b61\u5b78\u92fc\u7434\u3002 \u2462 \u9019\u500b\u4eba\u559c\u6b61\u4e00\u908a\u5f48\u92fc\u7434\u4e00\u908a\u5531\u6b4c\u3002 \u2463 \u9019\u500b\u4eba\u5728\u5b78\u9662\u5b78\u7fd2\u92fc\u7434\u4e09\u5e74\u3002","\u2461 This person likes learning how to play the piano. \u2462 This person likes singing songs while playing the piano. \u2463 This person has learned the piano at a piano academy for 3 years."," \u2460 \uc800\ub294 \ud53c\uc544\ub178\ub97c \ubc30\uc6b0\ub7ec \ub2e4\ub2d9\ub2c8\ub2e4.\n \u2461 \uc800\ub294 \ud53c\uc544\ub178 \ud559\uc6d0\uc744 \uadf8\ub9cc\ub450\uace0 \uc2f6\uc2b5\ub2c8\ub2e4.\n \u2462 \uc800\ub294 \uac00\uc218\uac00 \ub418\uae30 \uc704\ud574\uc11c \ud53c\uc544\ub178\ub97c \ubc30\uc6c1\ub2c8\ub2e4.\n \u2463 \uc800\ub294 \uc0bc \ub144 \uc804\ubd80\ud130 \ud559\uc6d0\uc5d0\uc11c \uc77c\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.",n,2,"\u2461\u3053\u306e\u4eba\u306f\u30d4\u30a2\u30ce\u3092\u5b66\u3076\u3053\u3068\u304c\u597d\u304d\u3067\u3059\u3002\u2462\u3053\u306e\u4eba\u306f\u30d4\u30a2\u30ce\u3092\u5f3e\u304d\u306a\u304c\u3089\u6b4c\u3046\u3053\u3068\u3092\u697d\u3057\u3093\u3067\u3044\u307e\u3059\u3002\u2463\u3053\u306e\u4eba\u306f3\u5e74\u524d\u304b\u3089\u30d4\u30a2\u30ce\u6559\u5ba4\u3067\u5b66\u3093\u3067\u3044\u307e\u3059\u3002","\u2461 \uc774 \uc0ac\ub78c\uc740 \ud53c\uc544\ub178 \ubc30\uc6b0\ub294 \uac83\uc744 \uc88b\uc544\ud569\ub2c8\ub2e4. \u2462 \uc774 \uc0ac\ub78c\uc740 \ud53c\uc544\ub178\ub97c \uce58\uba74\uc11c \ub178\ub798 \ubd80\ub974\ub294 \uac83\uc744 \uc990\uac70\uc6cc\ud569\ub2c8\ub2e4. \u2463 \uc774 \uc0ac\ub78c\uc740 \uc0bc \ub144 \uc804\ubd80\ud130 \ud559\uc6d0\uc5d0\uc11c \ud53c\uc544\ub178\ub97c \ubc30\uc6b0\uace0 \uc788\uc2b5\ub2c8\ub2e4. ","\u2461 Orang tersebut suka berlajar piano. \u2462 Orang tersebut berasa seronok semasa bermain piano sambil bernyanyi. \u2463 Orang tersebut pergi ke pusat akademi piano bermula dari 3 tahun lepas.",q,n,"60. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",p,o),A.l("\u2461 \ubc18\uac11\uace0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0627\u0644\u0623\u062e \u0627\u0644\u0635\u063a\u064a\u0631 \u0627\u0644\u0630\u064a \u0638\u0647\u0631 \u0641\u064a \u0627\u0644\u062a\u0644\u0641\u0632\u064a\u0648\u0646.\u0631\u0623\u0649 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0623\u062e\u0627\u0647 \u0627\u0644\u0635\u063a\u064a\u0631 \u0641\u064a \u0645\u0644\u0639\u0628 \u0627\u0644\u062a\u0646\u0633 \u0641\u064a \u0627\u0644\u062a\u0644\u0641\u0632\u064a\u0648\u0646.\u0634\u0639\u0631 \u0628\u0634\u0639\u0648\u0631 \u062c\u062f\u064a\u062f \u0648\u0628\u0633\u0639\u0627\u062f\u0629 \u0644\u0631\u0624\u064a\u0629 \u0623\u062e\u064a\u0647 \u0627\u0644\u0635\u063a\u064a\u0631 \u0641\u064a \u0627\u0644\u062a\u0644\u0641\u0632\u064a\u0648\u0646","\u8fd9\u7bc7\u6587\u7ae0\u4ecb\u7ecd\u7684\u662f\u81ea\u5df1\u7684\u5f1f\u5f1f\u4e0a\u7535\u89c6\u4e86\u3002 \u8fd9\u4e2a\u4eba\u5728\u7535\u89c6\u4e0a\u5728\u7f51\u7403\u573a\u770b\u5230\u4e86\u4ed6\u7684\u5f1f\u5f1f\u3002 \u5f88\u9ad8\u5174\u5728\u7535\u89c6\u4e0a\u770b\u5230\u5f1f\u5f1f\uff0c\u8fd9\u662f\u4e00\u79cd\u5f88\u65b0\u5947\u7684\u611f\u89c9\u3002","\u9019\u7bc7\u6587\u7ae0\u4ecb\u7d39\u7684\u662f\u81ea\u5df1\u7684\u5f1f\u5f1f\u4e0a\u96fb\u8996\u4e86\u3002\u9019\u500b\u4eba\u5728\u96fb\u8996\u4e0a\u5728\u7db2\u7403\u5834\u770b\u5230\u4e86\u4ed6\u7684\u5f1f\u5f1f\u3002\u4ed6\u5f88\u9ad8\u8208\u5728\u96fb\u8996\u4e0a\u770b\u5230\u4ed6\u7684\u5f1f\u5f1f\uff0c\u662f\u4e00\u7a2e\u5f88\u65b0\u5947\u7684\u611f\u89ba\u3002","This text is about this person's younger brother on TV. This person saw his brother in the tennis stadium on TV. This person was glad to see his brother on TV and felt a novel sensation."," \u2460 \ud3b8\ud558\uace0\n \u2461 \ubc18\uac11\uace0\n \u2462 \ubcf5\uc7a1\ud558\uace0\n \u2463 \ube44\uc2b7\ud558\uace0",n,3,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u30c6\u30ec\u30d3\u306b\u6620\u3063\u305f\u5f1f\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u4eba\u306f\u5f1f\u304c\u30c6\u30cb\u30b9\u7af6\u6280\u5834\u306b\u3044\u308b\u306e\u3092\u30c6\u30ec\u30d3\u3067\u898b\u307e\u3057\u305f\u3002\u5f1f\u3092\u30c6\u30ec\u30d3\u3067\u898b\u305f\u3089\u5b09\u3057\u304f\u3066\u3001\u65b0\u3057\u3044\u6c17\u6301\u3061\u306b\u306a\u308a\u307e\u3057\u305f\u3002","\uc774 \uae00\uc740 \ud154\ub808\ube44\uc804\uc5d0 \ub098\uc628 \ub3d9\uc0dd\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uc0ac\ub78c\uc740 \ub3d9\uc0dd\uc774 \ud14c\ub2c8\uc2a4 \uacbd\uae30\uc7a5\uc5d0 \uc788\ub294 \uac83\uc744 \ud154\ub808\ube44\uc804\uc5d0\uc11c \ubd24\uc2b5\ub2c8\ub2e4. \ub3d9\uc0dd\uc744 \ud154\ub808\ube44\uc804\uc5d0\uc11c \ubcf4\ub2c8\uae4c \ubc18\uac11\uace0 \uc0c8\ub85c\uc6b4 \uae30\ubd84\uc774 \ub4e4\uc5c8\uc2b5\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang saudara seseorang yang disiarkan di televisyen.Orang tersebut ternampak saudaranya di stadium tenis melalui TV.Orang tersebut berasa seronok kerana ternampak saudaranya di dalam TV dan berasa baharu.",q,n,"61. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",m,l),A.l("\u2460 \ub3d9\uc0dd\uc740 \ud14c\ub2c8\uc2a4\ub97c \ubcf4\ub7ec \uacbd\uae30\uc7a5\uc5d0 \uac14\uc2b5\ub2c8\ub2e4.","2- \u0631\u0623\u0649 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0623\u062e\u0627\u0647 \u0627\u0644\u0635\u063a\u064a\u0631 \u064a\u0635\u0641\u0642 3- \u0631\u0623\u0649 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0648\u062c\u0647 \u0623\u062e\u064a\u0647 \u0641\u064a \u0627\u0644\u062a\u0644\u0641\u0632\u064a\u0648\u0646 \u0623\u0648\u0644 \u0645\u0631\u0629 4- \u0631\u0623\u0649 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0623\u062e\u0627\u0647 \u0627\u0644\u0645\u0648\u062c\u0648\u062f \u0641\u064a \u0645\u0644\u0639\u0628 \u0627\u0644\u062a\u0646\u0633","\u2461\u8fd9\u4e2a\u4eba\u5728\u7535\u89c6\u4e0a\u770b\u5230\u4e86\u9f13\u638c\u7684\u5f1f\u5f1f\u3002 \u2462 \u8fd9\u4e2a\u4eba\u7b2c\u4e00\u6b21\u5728\u7535\u89c6\u4e0a\u770b\u5230\u5f1f\u5f1f\u7684\u8138\u3002 \u2463 \u8fd9\u4e2a\u4eba\u4eca\u5929\u5728\u7f51\u7403\u573a\u89c1\u5230\u4e86\u5f1f\u5f1f\u3002","\u2461\u9019\u500b\u4eba\u5728\u96fb\u8996\u4e0a\u770b\u5230\u4e86\u9f13\u638c\u7684\u5f1f\u5f1f\u3002 \u2462 \u9019\u500b\u4eba\u7b2c\u4e00\u6b21\u5728\u96fb\u8996\u4e0a\u770b\u5230\u5f1f\u5f1f\u7684\u81c9\u3002 \u2463 \u9019\u500b\u4eba\u4eca\u5929\u5728\u7db2\u7403\u5834\u898b\u5230\u4e86\u4ed6\u7684\u5f1f\u5f1f\u3002","\u2461 This person saw his brother clapping. \u2462 Thi person saw his brother's face on TV for the first time. \u2463 This person saw his brother in the tennis stadium today."," \u2460 \ub3d9\uc0dd\uc740 \ud14c\ub2c8\uc2a4\ub97c \ubcf4\ub7ec \uacbd\uae30\uc7a5\uc5d0 \uac14\uc2b5\ub2c8\ub2e4.\n \u2461 \uc800\ub294 \ubc15\uc218\ub97c \uce58\uba74\uc11c \ub3d9\uc0dd\uc758 \ubaa8\uc2b5\uc744 \ubcf4\uc558\uc2b5\ub2c8\ub2e4.\n \u2462 \uc804\uc5d0\ub3c4 \ud154\ub808\ube44\uc804\uc5d0\uc11c \ub3d9\uc0dd\uc758 \uc5bc\uad74\uc744 \ubcf4\uc558\uc2b5\ub2c8\ub2e4.\n \u2463 \uc800\ub294 \uc624\ub298 \ud14c\ub2c8\uc2a4 \uacbd\uae30\uc7a5\uc5d0\uc11c \ub3d9\uc0dd\uc744 \ub9cc\ub0ac\uc2b5\ub2c8\ub2e4. ",n,4,"\u2461\u3053\u306e\u4eba\u306f\u62cd\u624b\u3092\u3059\u308b\u5f1f\u306e\u59ff\u3092\u898b\u307e\u3057\u305f\u3002\u2462\u3053\u306e\u4eba\u306f\u521d\u3081\u3066\u30c6\u30ec\u30d3\u3067\u5f1f\u306e\u9854\u3092\u898b\u307e\u3057\u305f\u3002\u2463\u3053\u306e\u4eba\u306f\u4eca\u65e5\u30c6\u30cb\u30b9\u7af6\u6280\u5834\u306b\u3044\u308b\u5f1f\u3092\u30c6\u30ec\u30d3\u3067\u898b\u307e\u3057\u305f\u3002","\u2461 \uc774 \uc0ac\ub78c\uc740 \ubc15\uc218\ub97c \uce58\ub294 \ub3d9\uc0dd\uc758 \ubaa8\uc2b5\uc744 \ubd24\uc2b5\ub2c8\ub2e4. \u2462 \uc774 \uc0ac\ub78c\uc740 \ud154\ub808\ube44\uc804\uc5d0\uc11c \ub3d9\uc0dd\uc758 \uc5bc\uad74\uc744 \ucc98\uc74c \ubd24\uc2b5\ub2c8\ub2e4. \u2463 \uc774 \uc0ac\ub78c\uc740 \uc624\ub298 \ud14c\ub2c8\uc2a4 \uacbd\uae30\uc7a5\uc5d0 \uc788\ub294 \ub3d9\uc0dd\uc744 \ubcf4\uc558\uc2b5\ub2c8\ub2e4. ","\u2461 Orang tersebut ternampak saudaranya sedang bertepuk tangan. \u2462 Orang tersebut ternampak rupa saudaranya dari TV untuk pertama kali. \u2463 Orang tersebut ternampak saudaranya yang berada di stadium tenis pada hari ini.",q,n,"62. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",m,l),A.l("\u2463 \uccad\uc18c \ub0a0\uc9dc\uc640 \uc2dc\uac04\uc744 \uc54c\ub9ac\ub824\uace0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u0647\u0648 \u0625\u0631\u0634\u0627\u062f\u0627\u062a \u0627\u0644\u062a\u0646\u0638\u064a\u0641. \u064a\u0642\u062f\u0645 \u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u0625\u0631\u0634\u0627\u062f\u0627\u062a \u062d\u0648\u0644 \u0645\u0643\u0627\u0646 \u0627\u0644\u062a\u0646\u0638\u064a\u0641 \u0648\u0627\u0644\u0648\u0642\u062a \u0648\u0627\u0644\u062a\u0627\u0631\u064a\u062e","\u8fd9\u7bc7\u6587\u7ae0\u662f\u5173\u4e8e\u5927\u626b\u9664\u901a\u77e5\u3002\u672c\u6587\u63d0\u4f9b\u6709\u5173\u626b\u9664\u5730\u70b9\u3001\u626b\u9664\u65e5\u671f\u548c\u626b\u9664\u65f6\u95f4\u7b49\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u95dc\u65bc\u5927\u6383\u9664\u901a\u77e5\u3002\u672c\u6587\u63d0\u4f9b\u6709\u95dc\u6383\u9664\u5730\u9ede\u3001\u6383\u9664\u65e5\u671f\u548c\u6383\u9664\u6642\u9593\u7b49\u3002","This text is a cleaning notice. It guides the cleaning place, cleaning date, and cleaning time."," \u2460 \uccad\uc18c \uc7a5\uc18c\ub97c \ubc14\uafb8\ub824\uace0\n \u2461 \uccad\uc18c \uacc4\ud68d\uc744 \ubb3c\uc5b4\ubcf4\ub824\uace0\n \u2462 \uccad\uc18c \uc774\uc720\ub97c \uc124\uba85\ud558\ub824\uace0\n \u2463 \uccad\uc18c \ub0a0\uc9dc\uc640 \uc2dc\uac04\uc744 \uc54c\ub9ac\ub824\uace0",n,5,"\u3053\u306e\u6587\u7ae0\u306f\u6e05\u6383\u306e\u6848\u5185\u6587\u3067\u3059\u3002\u3053\u306e\u6848\u5185\u6587\u306f\u6e05\u6383\u5834\u6240\u3001\u6e05\u6383\u65e5\u3001\u305d\u3057\u3066\u6e05\u6383\u6642\u9593\u3092\u6848\u5185\u3057\u3066\u3044\u307e\u3059\u3002","\uc774 \uae00\uc740 \uccad\uc18c \uc548\ub0b4\ubb38\uc785\ub2c8\ub2e4. \uc774 \uae00\uc740 \uccad\uc18c \uc7a5\uc18c, \uccad\uc18c \ub0a0\uc9dc \uadf8\ub9ac\uace0 \uccad\uc18c \uc2dc\uac04\uc744 \uc548\ub0b4\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4.","Petikan tersebut adalah notis tentang pembersihan.Tempat,tarikh dan masa membuat pembersihan telah dikatakan dalam notis.",q,j,"63. \uc65c \uc774 \uae00\uc744 \uc37c\ub294\uc9c0 \ub9de\ub294 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",k,n),A.l("\u2460 \uc774\ud2c0 \ub3d9\uc548 \uc8fc\ucc28\uc7a5 \uccad\uc18c\ub97c \ud560 \uac81\ub2c8\ub2e4.","2-\u0633\u064a\u0628\u062f\u0623 \u062a\u0646\u0638\u064a\u0641 \u0645\u0648\u0642\u0641 \u0627\u0644\u0633\u064a\u0627\u0631\u0627\u062a \u064a\u0648\u0645 \u0627\u0644\u0625\u062b\u0646\u064a\u0646 3- \u064a\u0628\u062f\u0623 \u0627\u0644\u062a\u0646\u0638\u064a\u0641 \u0628\u0627\u0644\u0645\u0627\u0621 \u0644\u0645\u0648\u0642\u0641 \u0627\u0644\u0633\u064a\u0627\u0631\u0627\u062a \u0641\u064a \u0637\u0627\u0628\u0642 \u0627\u0644\u062a\u0633\u0648\u064a\u0629 \u0641\u064a \u0627\u0644\u0633\u0627\u0639\u0629 \u0627\u0644\u062a\u0627\u0633\u0639\u0629 \u0635\u0628\u0627\u062d\u0627 4- \u062a\u0645 \u062a\u0642\u062f\u064a\u0645 \u0625\u0631\u0634\u0627\u062f\u0627\u062a \u0627\u0644\u062a\u0646\u0638\u064a\u0641 \u064a\u0648\u0645 22 \u064a\u0648\u0644\u064a\u0648","\u2461 \u505c\u8f66\u573a\u6e05\u626b\u4ece\u661f\u671f\u4e00\u5f00\u59cb\u3002 \u2462 \u5730\u4e0b\u505c\u8f66\u573a\u6c34\u6e05\u6d17\u4ece\u4e0a\u53489:00\u5f00\u59cb\u3002 \u2463\u901a\u77e5\u8bf47\u670822\u53f7\u8fdb\u884c\u626b\u9664\u3002","\u2461 \u505c\u8eca\u5834\u6e05\u6383\u5f9e\u661f\u671f\u4e00\u958b\u59cb\u3002 \u2462 \u5730\u4e0b\u505c\u8eca\u5834\u6c34\u6e05\u6d17\u5f9e\u4e0a\u53489:00\u958b\u59cb\u3002 \u2463\u901a\u77e5\u8aaa7\u670822\u865f\u9032\u884c\u6383\u9664\u3002","\u2461 Cleaning the parking lot will begin on Monday \u2462 Water cleaning in the underground parking lot starts at 9 a.m. \u2463  Cleaning was guided on July 22nd."," \u2460 \uc774\ud2c0 \ub3d9\uc548 \uc8fc\ucc28\uc7a5 \uccad\uc18c\ub97c \ud560 \uac81\ub2c8\ub2e4.\n \u2461 \uc8fc\ucc28\uc7a5 \uccad\uc18c\ub294 \ud654\uc694\uc77c\uc5d0 \uc2dc\uc791\ud560 \uac81\ub2c8\ub2e4.\n \u2462 \uc9c0\ud558 \uc8fc\ucc28\uc7a5 \ubb3c\uccad\uc18c\ub294 \uc544\ud649 \uc2dc\uae4c\uc9c0 \ud569\ub2c8\ub2e4.\n \u2463 7\uc6d4 22\uc77c\uae4c\uc9c0 \ub2e4\ub978 \uc8fc\ucc28\uc7a5\uc744 \uc774\uc6a9\ud574\uc57c \ud569\ub2c8\ub2e4. ",n,6,"\u2461\u99d0\u8eca\u5834\u306e\u6e05\u6383\u306f\u6708\u66dc\u65e5\u306b\u59cb\u307e\u308a\u307e\u3059\u3002\u2462\u5730\u4e0b\u99d0\u8eca\u5834\u306e\u6c34\u6e05\u6383\u306f\u5348\u524d9\u6642\u304b\u3089\u3067\u3059\u3002\u24637\u670822\u65e5\u306b\u6e05\u6383\u306e\u6848\u5185\u3092\u3057\u307e\u3057\u305f\u3002","\u2461 \uc8fc\ucc28\uc7a5 \uccad\uc18c\ub294 \uc6d4\uc694\uc77c\uc5d0 \uc2dc\uc791\ud560 \uac81\ub2c8\ub2e4. \u2462 \uc9c0\ud558 \uc8fc\ucc28\uc7a5 \ubb3c\uccad\uc18c\ub294 \uc624\uc804 \uc544\ud649 \uc2dc\ubd80\ud130 \ud569\ub2c8\ub2e4. \u2463 7\uc6d4 22\uc77c\uc5d0 \uccad\uc18c\ub97c \uc548\ub0b4\ud588\uc2b5\ub2c8\ub2e4.","\u2461 Pembersihan tempat letak kerata bermula pada hari Isnin. \u2462 Pembersihan air di tempat letak kereta bawah tanah bermula dari 9 am.\u2463 Pembersihan pada 22 Julai telah dinotiskan.",q,j,"64. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",k,n),A.l("\u2463 \ub9c8\uc2dc\ub294 \ub3d9\uc548\uc5d0","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0645\u062b\u0644\u062c\u0629.\u0627\u0644\u062b\u0644\u062c \u0627\u0644\u0645\u062c\u0645\u062f \u0644\u0641\u062a\u0631\u0629 \u0637\u0648\u064a\u0644\u0629 \u0623\u0648 \u0627\u0644\u062b\u0644\u062c \u0627\u0644\u0643\u0628\u064a\u0631 \u064a\u0630\u0648\u0628 \u0628\u0628\u0637\u0626. \u0644\u0630\u0644\u0643 \u0625\u0630\u0627 \u0648\u0636\u0639\u062a \u0647\u0630\u0627 \u0627\u0644\u062b\u0644\u062c \u064a\u0645\u0643\u0646\u0643 \u0627\u0644\u0627\u0633\u062a\u0645\u062a\u0627\u0639 \u0628\u0637\u0639\u0645 \u0627\u0644\u0645\u0634\u0631\u0648\u0628 \u0643\u0645\u0627 \u0643\u0627\u0646 \u0641\u064a \u0627\u0644\u0628\u062f\u0627\u064a\u0629","\u6b64\u7bc7\u6587\u7ae0\u4ecb\u7ecd\u7684\u662f\u51b0\u996e\u6599\u3002\u5927\u51b0\u5757\u6216\u957f\u65f6\u95f4\u51bb\u7ed3\u7684\u51b0\u5757\u4f1a\u7f13\u6162\u878d\u5316\u3002\u6240\u4ee5\u5982\u679c\u52a0\u5165\u8fd9\u79cd\u51b0\u5757\uff0c\u559d\u7684\u65f6\u5019\u53ef\u4ee5\u957f\u65f6\u95f4\u4eab\u53d7\u996e\u6599\u7684\u5473\u9053\u3002","\u6b64\u7bc7\u6587\u7ae0\u4ecb\u7d39\u7684\u662f\u51b0\u98f2\u6599\u3002\u5927\u51b0\u584a\u6216\u9577\u6642\u9593\u51cd\u7d50\u7684\u51b0\u584a\u878d\u5316\u5f97\u6bd4\u8f03\u6162\u3002\u6240\u4ee5\u5982\u679c\u52a0\u5165\u9019\u7a2e\u51b0\u584a\uff0c\u559d\u7684\u6642\u5019\u53ef\u4ee5\u98f2\u6599\u7684\u5473\u9053\u6bd4\u8f03\u6c92\u90a3\u9ebc\u5feb\u8b8a\u3002","This text is about ice drinks. Large ice or ice that has been frozen for a long time melts slowly. So if these kinds of ice is added, someone can enjoy the taste of the first drink for a long time while drinking."," \u2460 \ub9c8\uc2dc\uc9c0\ub9cc\n \u2461 \ub9c8\uc2dc\ub824\uace0\n \u2462 \ub9c8\uc2dc\uae30 \ub54c\ubb38\uc5d0\n \u2463 \ub9c8\uc2dc\ub294 \ub3d9\uc548\uc5d0",n,7,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u6c37\u98f2\u6599\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u5927\u304d\u306a\u6c37\u200b\u200b\u3084\u9577\u6642\u9593\u51cd\u3089\u305b\u305f\u6c37\u306f\u3086\u3063\u304f\u308a\u6eb6\u3051\u307e\u3059\u3002\u3060\u304b\u3089\u3053\u306e\u3088\u3046\u306a\u6c37\u3092\u5165\u308c\u308b\u3068\u3001\u98f2\u3093\u3066\u3044\u308b\u9593\u3001\u6700\u521d\u306e\u5473\u3092\u9577\u304f\u697d\u3057\u3080\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002","\uc774 \uae00\uc740 \uc5bc\uc74c \uc74c\ub8cc\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \ud070 \uc5bc\uc74c\uc774\ub098 \uc624\ub798 \uc5bc\ub9b0 \uc5bc\uc74c\uc740 \ucc9c\ucc9c\ud788 \ub179\uc2b5\ub2c8\ub2e4. \uadf8\ub798\uc11c \uc774\ub7f0 \uc5bc\uc74c\uc744 \ub123\uc73c\uba74 \ub9c8\uc2dc\ub294 \ub3d9\uc548\uc5d0 \ucc98\uc74c \uc74c\ub8cc\uc758 \ub9db\uc744 \uc624\ub798 \uc990\uae38 \uc218 \uc788\uc2b5\ub2c8\ub2e4.","Petikan tersebut berbincang tentang minuman ais sejuk.Ketulan ais yang besar atau air yang berketul untuk masa yang lama susah untuk bercair.Jadi,kalau ketulan ais macam itu ditambah ke dalam minuman,orang boleh meminum minuman yang sejuk untuk masa yang panjang.",q,n,"65. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (2\uc810)",i,h),A.l("\u2461 \uc791\uc740 \uc5bc\uc74c\uc740 \ud070 \uc5bc\uc74c\ubcf4\ub2e4 \ube68\ub9ac \ub179\uc2b5\ub2c8\ub2e4.","1- \u0627\u0644\u062b\u0644\u062c \u0627\u0644\u0645\u062c\u0645\u062f \u0644\u0648\u0642\u062a \u0637\u0648\u064a\u0644 \u064a\u0630\u0648\u0628 \u0628\u0628\u0637\u0626. 3- \u064a\u0645\u0643\u0646 \u0627\u0644\u0627\u0633\u062a\u0645\u062a\u0627\u0639 \u0628\u0637\u0639\u0645 \u0627\u0644\u0645\u0634\u0631\u0648\u0628 \u0625\u0646 \u0648\u0636\u0639\u062a \u062b\u0644\u062c\u0627 \u0643\u0628\u064a\u0631\u0627. 4- \u064a\u062a\u063a\u064a\u0631 \u0637\u0639\u0645 \u0627\u0644\u0645\u0634\u0631\u0648\u0628 \u0628\u0628\u0637\u0626 \u0625\u0646 \u0648\u0636\u0639\u062a \u062b\u0644\u062c\u0627 \u0643\u0628\u064a\u0631\u0627 \u0623\u0648 \u062b\u0644\u062c\u0627 \u0645\u062c\u0645\u062f\u0627 \u0644\u0648\u0642\u062a \u0637\u0648\u064a\u0644","\u2460 \u957f\u65f6\u95f4\u51bb\u7ed3\u7684\u51b0\u4f1a\u6162\u6162\u878d\u5316\u3002 \u2462\u5982\u679c\u5728\u996e\u6599\u4e2d\u52a0\u5165\u5927\u51b0\u5757\uff0c\u53ef\u4ee5\u957f\u65f6\u95f4\u4eab\u7528\u3002 \u2463 \u52a0\u5165\u5927\u51b0\u5757\u6216\u957f\u65f6\u95f4\u51b7\u51bb\u7684\u51b0\u5757\u65f6\uff0c\u996e\u6599\u7684\u5473\u9053\u53d8\u5316\u7f13\u6162\u3002","\u2460 \u9577\u6642\u9593\u51cd\u7d50\u7684\u51b0\u878d\u5316\u5f97\u6bd4\u8f03\u6162\u3002 \u2462\u5982\u679c\u5728\u98f2\u6599\u4e2d\u52a0\u5165\u5927\u51b0\u584a\uff0c\u53ef\u4ee5\u9577\u6642\u9593\u4eab\u7528\u51b0\u51b7\u7684\u98f2\u6599\u3002 \u2463 \u52a0\u5165\u5927\u51b0\u584a\u6216\u9577\u6642\u9593\u51b7\u51cd\u7684\u51b0\u584a\u6642\uff0c\u98f2\u6599\u7684\u5473\u9053\u6bd4\u8f03\u4e0d\u5bb9\u6613\u8b8a\u3002","\u2460 The ice that has been frozen for a long time melts slowly. \u2462 If big ice cubes are added in someone's drink, the taste of the drink can be enjoyed for a long time. \u2463 The taste of the drink changes slowly when large ice cubes or ice that has been frozen for a long time are added."," \u2460 \uc624\ub798 \uc5bc\ub9b0 \uc5bc\uc74c\uc774 \ub354 \ube68\ub9ac \ub179\uc2b5\ub2c8\ub2e4.\n \u2461 \uc791\uc740 \uc5bc\uc74c\uc740 \ud070 \uc5bc\uc74c\ubcf4\ub2e4 \ube68\ub9ac \ub179\uc2b5\ub2c8\ub2e4.\n \u2462 \ud070 \uc5bc\uc74c\uc744 \uc74c\ub8cc\uc5d0 \ub123\uc73c\uba74 \ub9db\uc774 \uae08\ubc29 \ub2ec\ub77c\uc9d1\ub2c8\ub2e4.\n \u2463 \uc74c\ub8cc \ub9db\uc740 \uc791\uc740 \uc5bc\uc74c\uc744 \ub123\uc744 \ub54c \ucc9c\ucc9c\ud788 \ubcc0\ud569\ub2c8\ub2e4. ",n,8,"\u2460\u9577\u6642\u9593\u51cd\u3089\u305b\u305f\u6c37\u306f\u3086\u3063\u304f\u308a\u6eb6\u3051\u307e\u3059\u3002\u2462\u5927\u304d\u306a\u6c37\u3092\u98f2\u307f\u7269\u306b\u5165\u308c\u308b\u3068\u98f2\u307f\u7269\u306e\u5473\u3092\u9577\u304f\u697d\u3057\u3080\u3053\u3068\u304c\u3067\u304d\u307e\u3059\u3002\u2463\u98f2\u307f\u7269\u306e\u5473\u306f\u5927\u304d\u306a\u6c37\u3084\u9577\u6642\u9593\u51cd\u3089\u305b\u305f\u6c37\u3092\u5165\u308c\u305f\u6642\u306b\u3086\u3063\u304f\u308a\u3068\u5909\u5316\u3057\u307e\u3059\u3002","\u2460\uc624\ub798 \uc5bc\ub9b0 \uc5bc\uc74c\uc774 \ucc9c\ucc9c\ud788 \ub179\uc2b5\ub2c8\ub2e4. \u2462 \ud070 \uc5bc\uc74c\uc744 \uc74c\ub8cc\uc5d0 \ub123\uc73c\uba74 \uc74c\ub8cc\uc758 \ub9db\uc744 \uc624\ub798 \uc990\uae38 \uc218 \uc788\uc2b5\ub2c8\ub2e4. \u2463 \uc74c\ub8cc \ub9db\uc740 \ud070 \uc5bc\uc74c\uc774\ub098 \uc624\ub798 \uc5bc\ub9b0 \uc5bc\uc74c\uc744 \ub123\uc744 \ub54c \ucc9c\ucc9c\ud788 \ubcc0\ud569\ub2c8\ub2e4.","\u2460Ketulan air yang berketul untuk masa yang panjang tidak mudah bercair. \u2462 Seseorang dapat menikmati minuman yang sejuk untuk masa yang lama kalau ketulan ais besar ditambahkan.  \u2463  Perasaan minuman akan bertukar jika ketulan ais yang besar atau air yang berketul untuk masa yang panjang diletakkan.",q,n,"66. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",i,h),A.l("\u2463 \ub9cc\ub4e4\uae30 \uc2dc\uc791\ud588\uc2b5\ub2c8\ub2e4","\u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u064a\u062a\u0643\u0644\u0645 \u0639\u0646 \u0627\u0633\u0645 \u0627\u0644\u0625\u0639\u0635\u0627\u0631.\u062a\u0636\u0639 \u0627\u0644\u062f\u0648\u0644\u0629 \u0627\u0644\u062a\u064a \u064a\u0645\u0631 \u0641\u064a\u0647\u0627 \u0627\u0644\u0625\u0639\u0635\u0627\u0631 \u0627\u0633\u0645\u0647.\u0644\u0630\u0644\u0643 \u0628\u062f\u0623\u062a \u0643\u0648\u0631\u064a\u0627 \u0628\u0648\u0636\u0639 \u0623\u0633\u0645\u0627\u0621 \u0627\u0644\u0623\u0639\u0627\u0635\u064a\u0631 \u0645\u0646\u0630 \u0633\u0646\u0629 2000","\u8fd9\u7bc7\u6587\u7ae0\u4ecb\u7ecd\u7684\u662f\u53f0\u98ce\u7684\u540d\u79f0\u3002\u7531\u53f0\u98ce\u7ecf\u8fc7\u7684\u56fd\u5bb6\u6765\u53f0\u98ce\u521b\u5efa\u4e00\u4e2a\u540d\u79f0\u3002\u56e0\u6b64\u97e9\u56fd\u4e5f\u5728 2000 \u5e74\u5f00\u59cb\u4e3a\u53f0\u98ce\u547d\u540d\u3002","\u9019\u7bc7\u6587\u7ae0\u4ecb\u7d39\u7684\u662f\u98b1\u98a8\u7684\u540d\u7a31\u3002\u70ba\u98b1\u98a8\u7d93\u904e\u7684\u570b\u5bb6/\u5730\u5340\u7684\u98b1\u98a8\u5275\u5efa\u4e00\u500b\u540d\u7a31\u3002\u56e0\u6b64\uff0c\u97d3\u570b\u4e5f\u5728 2000 \u5e74\u958b\u59cb\u70ba\u98b1\u98a8\u547d\u540d\u3002","This text is about the name of the typhoon. The name of a typhoon is made by a country where a typhoon passes by. So Korea also started to make the name of the typhoon in 2000."," \u2460 \ubd80\ub974\ub824\uace0 \ud569\ub2c8\ub2e4\n \u2461 \uc6d0\ud558\uace0 \uc788\uc2b5\ub2c8\ub2e4\n \u2462 \ubc14\uafb8\uae30\ub85c \ud588\uc2b5\ub2c8\ub2e4\n \u2463 \ub9cc\ub4e4\uae30 \uc2dc\uc791\ud588\uc2b5\ub2c8\ub2e4",n,9,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u53f0\u98a8\u306e\u540d\u524d\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u53f0\u98a8\u304c\u901a\u904e\u3059\u308b\u56fd\u3067\u53f0\u98a8\u306e\u540d\u524d\u3092\u4ed8\u3051\u307e\u3059\u3002\u3057\u305f\u304c\u3063\u3066\u97d3\u56fd\u30822000\u5e74\u304b\u3089\u53f0\u98a8\u306e\u540d\u524d\u3092\u4ed8\u3051\u59cb\u3081\u307e\u3057\u305f\u3002","\uc774 \uae00\uc740 \ud0dc\ud48d\uc758 \uc774\ub984\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \ud0dc\ud48d\uc774 \uc9c0\ub098\uac00\ub294 \ub098\ub77c\uc5d0\uc11c \ud0dc\ud48d\uc758 \uc774\ub984\uc744 \ub9cc\ub4ed\ub2c8\ub2e4. \uadf8\ub798\uc11c \ud55c\uad6d\ub3c4 2000\ub144\ubd80\ud130 \ud0dc\ud48d\uc758 \uc774\ub984\uc744 \ub9cc\ub4e4\uae30 \uc2dc\uc791\ud588\uc2b5\ub2c8\ub2e4. ","Petikan tersebut berbincang tentang taufan.Nama taufan dibina oleh negara yang berlaku taufan.Jadi,Korea bermula untuk membina nama taufan sejak tahun 2000.",q,n,"67. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",g,f),A.l("\u2462 \ud0dc\ud48d\uc758 \uc774\ub984\uc740 \uc5f4\ub124 \uac1c \ub098\ub77c\uc5d0\uc11c \ub9cc\ub4ed\ub2c8\ub2e4.","1- \u062a\u062d\u062f\u062b \u0627\u0644\u0623\u0639\u0627\u0635\u064a\u0631 \u0643\u062b\u064a\u0631\u0627 \u0645\u0646 \u0634\u0647\u0631 \u064a\u0648\u0644\u064a\u0648 \u062d\u062a\u0649 \u0634\u0647\u0631 \u0633\u0628\u062a\u0645\u0628\u0631. 2- \u062a\u0645\u0631 \u0627\u0644\u0623\u0639\u0627\u0635\u064a\u0631 \u0628\u0643\u0648\u0631\u064a\u0627 \u0623\u064a\u0636\u0627. 4- \u0646\u0637\u0642 \u0627\u0633\u0645\u0627\u0621 \u0627\u0644\u0623\u0639\u0627\u0635\u064a\u0631 \u0627\u0644\u0643\u0648\u0631\u064a\u0629 \u0633\u0647\u0644","\u2460 \u53f0\u98ce\u901a\u5e38\u53d1\u751f\u5728 7\u6708\u81f3 9\u6708\u3002 \u2461 \u53f0\u98ce\u7ecf\u8fc7\u97e9\u56fd\u3002 \u2463 \u53f0\u98ce\u7684\u97e9\u6587\u540d\u5b57\u8bfb\u8d77\u6765\u66f4\u5bb9\u6613\u3002","\u2460 \u98b1\u98a8\u901a\u5e38\u767c\u751f\u5728 7\u6708\u81f3 9\u6708\u3002 \u2461 \u98b1\u98a8\u7d93\u904e\u97d3\u570b\u3002 \u2463 \u98b1\u98a8\u7684\u97d3\u6587\u540d\u5b57\u8b80\u8d77\u4f86\u66f4\u5bb9\u6613\u3002","\u2460 Typhoons usually occur from July to September. \u2461 A typhoon is passing by in Korea, too. \u2463 The Korean name of the typhoon is easy to pronounce."," \u2460 \ud0dc\ud48d\uc740 \ubcf4\ud1b5 \uaca8\uc6b8\uacfc \ubd04\uc5d0 \uc0dd\uae41\ub2c8\ub2e4.\n \u2461 \ud55c\uad6d\uc5d0\ub294 \ud0dc\ud48d\uc774 \uac70\uc758 \ubd88\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.\n \u2462 \ud0dc\ud48d\uc758 \uc774\ub984\uc740 \uc5f4\ub124 \uac1c \ub098\ub77c\uc5d0\uc11c \ub9cc\ub4ed\ub2c8\ub2e4.\n \u2463 \ud0dc\ud48d\uc758 \ud55c\uad6d\uc5b4 \uc774\ub984\uc740 \ubc1c\uc74c\uc774 \uc27d\uc9c0 \uc54a\uc2b5\ub2c8\ub2e4.",n,10,"\u2460\u53f0\u98a8\u306f\u901a\u5e387\u6708\u304b\u30899\u6708\u307e\u3067\u591a\u304f\u767a\u751f\u3057\u307e\u3059\u3002\u2461\u97d3\u56fd\u3082\u53f0\u98a8\u304c\u901a\u904e\u3057\u307e\u3059\u3002\u2463\u53f0\u98a8\u306e\u97d3\u56fd\u540d\u306f\u767a\u97f3\u304c\u7c21\u5358\u3067\u3059\u3002","\u2460 \ud0dc\ud48d\uc740 \ubcf4\ud1b5 7\uc6d4\ubd80\ud130 9\uc6d4\uae4c\uc9c0 \ub9ce\uc774 \uc0dd\uae41\ub2c8\ub2e4. \u2461 \ud55c\uad6d\ub3c4 \ud0dc\ud48d\uc774 \uc9c0\ub098\uac11\ub2c8\ub2e4. \u2463 \ud0dc\ud48d\uc758 \ud55c\uad6d\uc5b4 \uc774\ub984\uc740 \ubc1c\uc74c\uc774 \uc27d\uc2b5\ub2c8\ub2e4.","\u2460 Taufan biasanya berlaku pada bulan Julai hingga September.\u2461 Terdapat taufan di Korea juga. \u2463 Nama taufan di Korea senang untuk membaca.",q,n,"68. \uc774 \uae00\uc758 \ub0b4\uc6a9\uacfc \uac19\uc740 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",g,f),A.l("\u2462 \ud06c\uace0 \uac74\uac15\ud574\uc838\uc11c","\u064a\u062a\u062d\u062f\u062b \u0647\u0630\u0627 \u0627\u0644\u0646\u0635 \u0639\u0646 \u0627\u0644\u0643\u0644\u0627\u0628 \u0627\u0644\u062a\u064a \u0644\u0627 \u0645\u0627\u0644\u0643 \u0644\u0647\u0627.\u0647\u0630\u0627 \u0627\u0644\u0643\u0644\u0628 \u0643\u0627\u0646 \u0641\u064a \u0627\u0644\u0628\u062f\u0627\u064a\u0629 \u0635\u063a\u064a\u0631\u0627 \u0648\u0646\u062d\u064a\u0641\u0627 \u0644\u0643\u0646\u0647 \u0627\u0644\u0622\u0646 \u0623\u0635\u0628\u062d \u0643\u0628\u064a\u0631\u0627 \u0648\u062a\u062d\u0633\u0646\u062a \u0635\u062d\u062a\u0647","\u8fd9\u7bc7\u6587\u7ae0\u662f\u8bb2\u5173\u4e8e\u4e00\u53ea\u6ca1\u6709\u4e3b\u4eba\u7684\u5c0f\u72d7\u3002\u8fd9\u53ea\u5c0f\u72d7\u8d77\u521d\u53c8\u5c0f\u53c8\u7626\uff0c\u4f46\u73b0\u5728\u53c8\u5927\u53c8\u5065\u5eb7\u3002","\u9019\u7bc7\u6587\u7ae0\u662f\u8b1b\u95dc\u65bc\u4e00\u96bb\u6c92\u6709\u4e3b\u4eba\u7684\u5c0f\u72d7\u3002\u9019\u96bb\u5c0f\u72d7\u8d77\u521d\u53c8\u5c0f\u53c8\u7626\uff0c\u4f46\u73fe\u5728\u53c8\u5927\u53c8\u5065\u5eb7\u3002","This text is about a dog without an owner. This dog was small and thin at first, but now it is big and healthy."," \u2460 \uc7a0\uc774 \ub9ce\uc544\uc838\uc11c\n \u2461 \uc8fc\uc778\uc744 \ucc3e\uc544\uc11c\n \u2462 \ud06c\uace0 \uac74\uac15\ud574\uc838\uc11c\n \u2463 \uacc4\uc18d \ub5a8\uace0 \uc788\uc5b4\uc11c",n,11,"\u3053\u306e\u6587\u7ae0\u306f\u3001\u98fc\u3044\u4e3b\u306e\u3044\u306a\u3044\u72ac\u306b\u3064\u3044\u3066\u306e\u8a71\u3067\u3059\u3002\u3053\u306e\u72ac\u306f\u6700\u521d\u306f\u5c0f\u3055\u304f\u75e9\u305b\u3066\u3044\u307e\u3057\u305f\u304c\u3001\u4eca\u306f\u5927\u304d\u304f\u5143\u6c17\u306b\u306a\u308a\u307e\u3057\u305f\u3002","\uc774 \uae00\uc740 \uc8fc\uc778\uc774 \uc5c6\ub294 \uac15\uc544\uc9c0\uc5d0 \ub300\ud55c \uc774\uc57c\uae30\uc785\ub2c8\ub2e4. \uc774 \uac15\uc544\uc9c0\ub294 \ucc98\uc74c\uc5d0\ub294 \uc791\uace0 \ub9d0\ub790\uc5c8\uc9c0\ub9cc \uc774\uc81c\ub294 \ud06c\uace0 \uac74\uac15\ud574\uc84c\uc2b5\ub2c8\ub2e4.","Petikan tersebut berbincang tentang seekor anjing yang tidak mempunyai pemilik.Anjing itu sangat kecil dan kurus pada mula-mulanya,tetapi sekarang menjadi besar dan sihat.",q,n,"69. \u3260\uc5d0 \ub4e4\uc5b4\uac08 \uc54c\ub9de\uc740 \ub9d0\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",e,d),A.l("\u2463 \uc800\ub294 \uae38\uc5d0\uc11c \ub370\ub824\uc628 \uac15\uc544\uc9c0\ub97c \ud0a4\uc6b0\uace0 \uc788\uc2b5\ub2c8\ub2e4. ","1- \u0644\u0645 \u064a\u0642\u0627\u0628\u0644 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0645\u0627\u0644\u0643 \u0627\u0644\u0643\u0644\u0628 2- \u0623\u062d\u0636\u0631 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0643\u0644\u0628 \u0625\u0644\u0649 \u0628\u064a\u062a\u0647 3- \u0644\u0627 \u064a\u062d\u0628 \u0647\u0630\u0627 \u0627\u0644\u0634\u062e\u0635 \u0623\u0646 \u064a\u062a\u0641\u0631\u0642 \u0639\u0646 \u0647\u0630\u0627 \u0627\u0644\u0643\u0644\u0628","\u2460 \u8fd9\u4e2a\u4eba\u6ca1\u6709\u89c1\u8fc7\u72d7\u7684\u4e3b\u4eba\u3002 \u2461 \u8fd9\u4e2a\u4eba\u628a\u5c0f\u72d7\u5e26\u56de\u5bb6\u4e86\u3002 \u2462 \u8fd9\u4e2a\u4eba\u4e0d\u60f3\u548c\u8fd9\u53ea\u5c0f\u72d7\u5206\u5f00\u3002","\u2460 \u9019\u500b\u4eba\u6c92\u6709\u898b\u904e\u72d7\u7684\u4e3b\u4eba\u3002 \u2461 \u9019\u500b\u4eba\u628a\u5c0f\u72d7\u5e36\u56de\u5bb6\u4e86\u3002 \u2462 \u9019\u500b\u4eba\u4e0d\u60f3\u548c\u9019\u96bb\u5c0f\u72d7\u5206\u958b\u3002","\u2460 This person can't meet the owner of the dog. \u2461 This preson brought the dog home. \u2462 This person doesn't want to be apart from the dog."," \u2460 \uc800\ub294 \uac15\uc544\uc9c0\uc758 \uc8fc\uc778\uc744 \ub9cc\ub0ac\uc2b5\ub2c8\ub2e4.\n \u2461 \uc800\ub294 \uc774 \uac15\uc544\uc9c0\ub97c \uc783\uc5b4\ubc84\ub838\uc2b5\ub2c8\ub2e4.\n \u2462 \uc800\ub294 \uc774 \uac15\uc544\uc9c0\ub97c \ud0a4\uc6b0\ub294 \uac83\uc774 \uc2eb\uc2b5\ub2c8\ub2e4.\n \u2463 \uc800\ub294 \uae38\uc5d0\uc11c \ub370\ub824\uc628 \uac15\uc544\uc9c0\ub97c \ud0a4\uc6b0\uace0 \uc788\uc2b5\ub2c8\ub2e4. ",n,12,"\u2460\u3053\u306e\u4eba\u306f\u72ac\u306e\u98fc\u3044\u4e3b\u306b\u4f1a\u3048\u3066\u3044\u307e\u305b\u3093\u3002\u2461\u3053\u306e\u4eba\u306f\u72ac\u3092\u5bb6\u306b\u9023\u308c\u3066\u304d\u307e\u3057\u305f\u3002\u2462\u3053\u306e\u4eba\u306f\u3053\u306e\u72ac\u3068\u5225\u308c\u308b\u306e\u304c\u5acc\u3067\u3059\u3002","\u2460 \uc774 \uc0ac\ub78c\uc740 \uac15\uc544\uc9c0\uc758 \uc8fc\uc778\uc744 \ub9cc\ub098\uc9c0 \ubabb\ud588\uc2b5\ub2c8\ub2e4. \u2461 \uc774 \uc0ac\ub78c\uc740 \uac15\uc544\uc9c0\ub97c \uc9d1\uc73c\ub85c \ub370\ub824\uc654\uc2b5\ub2c8\ub2e4. \u2462 \uc774 \uc0ac\ub78c\uc740 \uc774 \uac15\uc544\uc9c0\uc640 \ud5e4\uc5b4\uc9c0\ub294 \uac83\uc774 \uc2eb\uc2b5\ub2c8\ub2e4.","\u2460 Orang tersebut tidak dapat berjumpat dengan pemilik anjing itu. \u2461 Orang tersebut membawa anjing itu ke rumahnya. \u2462 Orang tersebut tidak ingin berjauh dengan anjing itu.",q,n,"70. \uc774 \uae00\uc758 \ub0b4\uc6a9\uc73c\ub85c \uc54c \uc218 \uc788\ub294 \uac83\uc744 \uace0\ub974\uc2ed\uc2dc\uc624. (3\uc810)",e,d)],t.p)})
